INSERT INTO `tag_description` VALUES ('/m/0102yr0l','2004 December solstice occurred on December 21, 2004.'),('/m/0102yr1b','2005 December solstice occurred on December 21, 2005.'),('/m/010b229x','The 2006 Sci-Fi-London Film Festival was held from April 26, 2006 to April 30, 2006.'),('/m/010bh74v','The 2006 London Turkish Film Festival was held from March 10, 2006 to March 16, 2006.'),('/m/010bh825','The 2004 London Turkish Film Festival was held from December 3, 2004 to December 12, 2004.'),('/m/010br2jl','The 2004 Portobello Film Festival was held from August 6, 2004 to August 22, 2004.'),('/m/010bt565','The 2004 UK Jewish Film Festival was held from October 16, 2004 to October 21, 2004.'),('/m/010c71sp','The 2004 French Film Festival UK was held from November 15, 2004 to December 5, 2004.'),('/m/010c71t_','The 2006 French Film Festival UK was held from March 1, 2006 to March 30, 2006.'),('/m/010grtp2','Break Down was an artwork created by Young British Artist Michael Landy in London in February 2001, as a reaction to the consumerist society.\nThe work was commissioned jointly commissioned by The Times newspaper and Artangel, as part of the Artangel Open bidding process. It was selected from 700 bids by a panel that included Brian Eno, Rachel Whiteread, Richard Cork, James Lingwood and Michael Morris. Another work was a recreation of the Battle of Orgreave by Jeremy Deller.\nIn February 2001, Landy gathered all his possessions at a former C&A branch at 499 Oxford Street near Marble Arch. Over the previous 3 years he had catalogued all 7,227 of his possessions, from postage stamps, his passport and birth certificate, to food, clothes, works of art, and his Saab 900 Turbo 16 S. The world were arranged into ten categories - artworks, clothing, equipment, furniture, kitchen, leisure, motor vehicle, perishables, reading material and studio material. They were then all destroyed in a two week period, opened as a public exhibition. The process of destruction was like the reverse of an industrial assembly line, with items circulating in yellow trays on 160 metres long figure-of-eight conveyor belt. Ten workers systematically removed each item from the convey belt and reduced it to its basic materials by smashing, shredding and pulverising them. The work attracted around 45,000 visitors.'),('/m/010hv70g','The 2006 London Lesbian Film Festival was held from April 28, 2006 to April 30, 2006.'),('/m/010k1n8h','The 2006 Italian Film Festival UK was held from November 17, 2006 to December 4, 2006.'),('/m/010n78j5','The 2004 BFM International Film Festival was held from September 10, 2004 to September 16, 2004.'),('/m/010n7qf_','The 2005 BFM International Film Festival was held from September 9, 2005 to September 18, 2005.'),('/m/010n7yvd','The 2006 BFM International Film Festival was held from September 8, 2006 to September 15, 2006.'),('/m/0133rf','The Turner Prize, named after the painter J. M. W. Turner, is an annual prize presented to a British visual artist under the age of 50. Awarding the prize is organised by the Tate gallery and staged at Tate Britain. Since its beginnings in 1984 it has become the United Kingdom\'s most publicised art award. Although it represents all media, painters have also won the prize.\nAs of 2004, the monetary award was established at £40,000. There have been different sponsors, including Channel 4 television and Gordon\'s Gin. The prize has been awarded by various distinguished celebrities: in 2006 this was Yoko Ono, and in 2012 the award was presented by Jude Law.\nIt is a controversial event, mainly for the exhibits, such as \"The Physical Impossibility of Death in the Mind of Someone Living\", a shark in formaldehyde by Damien Hirst and \"My Bed\", a dishevelled bed by Tracey Emin. Controversy has also come from other directions, including a Culture Minister criticising exhibits, a guest of honour swearing, a prize judge writing in the press, and a speech by Sir Nicholas Serota.'),('/m/0138pl','Christina Georgina Rossetti was an English poet who wrote a variety of romantic, devotional, and children\'s poems. She is perhaps best known for her long poem Goblin Market, her love poem Remember, and for the words of the Christmas carol In the Bleak Midwinter.'),('/m/013v45','The Lincoln County War was an Old West range war between rival factions in 1878 in New Mexico Territory. The feud became famous because of the participation of a number of notable figures of the Old West, including Billy the Kid, sheriffs William Brady and Pat Garrett, cattle rancher John Chisum, lawyer and businessman Alexander McSween, and the organized crime boss Lawrence Murphy.\nThe war was fictionalized in several Hollywood films, including The Left Handed Gun in 1958, John Wayne\'s Chisum in 1970, and the 1988 film Young Guns.\nThe conflict arose between two factions over the control of dry goods trade in the county. The older, established faction was led by Murphy and his business partner, James Dolan, who operated a dry goods monopoly through Murphy\'s general store. Young newcomers to the county, English-born John Tunstall and his business partner Alexander McSween, with backing from established cattleman John Chisum, opened a competing store in 1876. The two sides gathered lawmen, businessmen, Tunstall\'s ranch hands and criminal gangs to their support. The Murphy-Dolan faction were allied with Lincoln County Sheriff Brady, and supported by the Jesse Evans Gang.'),('/m/014wxs','The Young British Artists, or YBAs — also referred to as Brit artists and Britart — is the name given to a loose group of visual artists who first began to exhibit together in London, in 1988. Many of the artists graduated from the BA Fine Art course at Goldsmiths, in the late 1980s.\nThe scene began around a series of artist-led exhibitions held in warehouses and factories, beginning in 1988 with the Damien Hirst-led Freeze and, in 1990, East Country Yard Show and Modern Medicine.\nThey are noted for \"shock tactics\", use of throwaway materials, wild-living, and an attitude \"both oppositional and entrepreneurial.\" They achieved considerable media coverage and dominated British art during the 1990s—international survey shows in the mid-1990s included Brilliant! and Sensation.\nMany of the artists were initially supported and collected by Charles Saatchi. Leading artists of the group include Damien Hirst and Tracey Emin. Key works include Hirst\'s The Physical Impossibility of Death in the Mind of Someone Living, a shark preserved in formaldehyde in a vitrine, and Emin\'s My Bed, a dishevelled double bed surrounded by detritus.'),('/m/01531','The Bronx is the northernmost of the five boroughs of New York City, in the U.S. state of New York. Coextensive with Bronx County, it was the last of the 62 counties of New York State to be incorporated. Located north of Manhattan and Queens, and south of Westchester County, the Bronx is the only borough that is located primarily on the mainland. The Bronx\'s population was 1,385,108 according to the 2010 United States Census, increasing to a Census-estimated 1,418,733 by 2013. The borough has a land area of 42 square miles, making it the fourth-largest inland area of the five boroughs, the fourth most populated, and the third-highest in population density.\nThe Bronx is divided by the Bronx River into a hillier section in the west, closer to Manhattan, and the flatter eastern section, closer to Long Island. Technically, the West Bronx is divided from the East Bronx by Jerome Avenue—the continuation of Manhattan\'s Fifth Avenue—making the West Bronx roughly one-eighth the size of the East Bronx. The West Bronx was annexed to New York City in 1874, and the areas east of the Bronx River were annexed in 1895.'),('/m/015g1w','The Royal Academy of Arts is an art institution based in Burlington House on Piccadilly in London. It has a unique position as an independent, privately funded institution led by eminent artists and architects; its purpose is to promote the creation, enjoyment and appreciation of the visual arts through exhibitions, education and debate.'),('/m/015sxw','Tracey Emin, CBE, RA is a Cypriot English artist. She is part of the group known as Britartists or YBAs.\nIn 1997, her work Everyone I Have Ever Slept With 1963–1995, a tent appliquéd with names, was shown at Charles Saatchi\'s Sensation exhibition held at the Royal Academy in London. The same year, she gained considerable media exposure when she appeared drunk and swearing on a live Channel 4 TV discussion.\nIn 1999, Emin had her first solo exhibition in the United States at Lehmann Maupin Gallery, entitled \"Every Part of Me\'s Bleeding\". Later that year, she was a Turner Prize nominee and exhibited My Bed — an installation, consisting of her own unmade dirty bed with used condoms and blood-stained underwear.\nIn 2004, her tent artwork was destroyed in the Momart warehouse fire. In March 2007 Emin was chosen to join the Royal Academy of Arts in London as a Royal Academician. She represented Britain at the 2007 Venice Biennale. Her first major retrospective 20 Years was held in Edinburgh 2008, and toured Europe until 2009.\nIn May 2011, Emin\'s largest major solo exhibition in a public space was held at Hayward Gallery, London titled Love Is What You Want.'),('/m/015wy_','Goldsmiths, University of London, is a public research university and a constituent college of the federal University of London which specialises in the arts, designs, humanities, and social sciences. It was founded in 1891 as Goldsmiths\' Technical and Recreative Institute by the Worshipful Company of Goldsmiths in New Cross, London. It was acquired by the University of London in 1904 and was renamed Goldsmiths\' College. The word College was dropped from its branding in 2006, but \"Goldsmiths\' College\", with the apostrophe, remains the institution\'s formal legal name.\nThe university has a distinguished history of contributing to arts and social sciences. Its Department of Art is widely recognised as one of Britain\'s most prestigious, producing the YBA\'s art collective and over 20 Turner Prize nominees. Goldsmiths is also famous for design, psychology, drama, sociology, music, media and cultural studies, languages and literature, visual cultures, anthropology and educational studies.\nNearly 20% of students come from countries outside the UK, and 52% of all undergraduates are mature students. Around a third of students at Goldsmiths are postgraduate students.'),('/m/016jgn','Mark Wallinger is a British artist, best known for his sculpture for the empty fourth plinth in Trafalgar Square, Ecce Homo, and State Britain, a recreation at Tate Britain of Brian Haw\'s protest display outside parliament. He won the Turner Prize in 2007. In October 2010, he and 100 other leading artists signed an open letter to the Culture Minister Jeremy Hunt protesting against cutbacks in the arts - he created a new work, \"Reckless\", for the protest.'),('/m/016r9z','The 1900 Summer Olympics, today officially known as the Games of the II Olympiad, was an international multi-sport event which was celebrated in 1900 in Paris, France. No opening or closing ceremonies were held; competitions began on May 14 and ended on October 28. The Games were held as part of the 1900 World\'s Fair. 997 competitors took part in 19 different sports. Women took part in the games for the first time and sailor Hélène de Pourtalès became the first female Olympic champion. The decision to hold competitions on a Sunday brought protests from many American athletes, who travelled as representatives of their colleges and were expected to withdraw rather than compete on their religious day of rest.\nAt the Sorbonne conference of 1895, Pierre de Coubertin proposed that the Olympic Games should take place in 1900 in Paris. The delegates to the conference were unwilling to wait five years and lobbied to hold the first games in 1896. A decision was made to hold the first Olympic Games in 1896 in Athens and that Paris would host the second celebration.\nMost of the winners in 1900 did not receive medals, but were given cups or trophies. Professionals competed in fencing and Albert Robert Ayat, who won the épée for amateurs and masters, was awarded a prize of 3000 francs.'),('/m/018dlc','Sir Edward Coley Burne-Jones, 1st Baronet ARA was a British artist and designer closely associated with the later phase of the Pre-Raphaelite movement, who worked closely with William Morris on a wide range of decorative arts as a founding partner in Morris, Marshall, Faulkner, and Company. Burne-Jones was closely involved in the rejuvenation of the tradition of stained glass art in Britain; his stained glass works include the windows of St. Philip\'s Cathedral, Birmingham, St Martin in the Bull Ring, Birmingham, Holy Trinity Church, Sloane Square, Chelsea, St Martin\'s Church in Brampton, Cumbria, St Michael\'s Church, Brighton, All Saints, Jesus Lane, Cambridge, Christ Church, Oxford and in St. Anne\'s Church, Brown Edge, Staffordshire Moorlands. Burne-Jones\'s early paintings show the heavy inspiration of Dante Gabriel Rossetti, but by the 1860s Burne-Jones was discovering his own artistic \"voice\". In 1877, he was persuaded to show eight oil paintings at the Grosvenor Gallery. These included The Beguiling of Merlin. The timing was right, and he was taken up as a herald and star of the new Aesthetic Movement.'),('/m/018dx9','Conceptual art, sometimes simply called Conceptualism, is art in which the concept or idea involved in the work take precedence over traditional aesthetic and material concerns. Many works of conceptual art, sometimes called installations, may be constructed by anyone simply by following a set of written instructions. This method was fundamental to American artist Sol LeWitt\'s definition of Conceptual art, one of the first to appear in print:\nIn conceptual art the idea or concept is the most important aspect of the work. When an artist uses a conceptual form of art, it means that all of the planning and decisions are made beforehand and the execution is a perfunctory affair. The idea becomes a machine that makes the art.\nTony Godfrey, author of Conceptual Art, asserts that conceptual art questions the nature of art, a notion that Joseph Kosuth elevated to a definition of art itself in his seminal, early manifesto of conceptual art, \"Art after Philosophy\". The notion that art should examine its own nature was already a potent aspect of the influential art critic Clement Greenberg\'s vision of Modern art during the 1950s.'),('/m/019h4r','Gilbert Prousch, sometimes referred to as Gilbert Proesch, and George Passmore are two artists who work together as a collaborative duo called Gilbert & George. They are known for their distinctive and highly formal appearance and manner and also for their brightly coloured graphic-style photo-based artworks.'),('/m/01b_88','Christopher Ofili, known as Chris Ofili, is an English Turner Prize-winning painter who is best known for his paintings incorporating elephant dung. He was one of the Young British Artists. Since 2005, Ofili has been living and working in Trinidad, where he currently resides in Port of Spain.'),('/m/01c0v6','Steven Rodney \"Steve\" McQueen CBE is a British film director, producer, screenwriter, and video artist. For his 2013 film, 12 Years a Slave, he won an Academy Award, BAFTA Award for Best Film and Golden Globe for Best Motion Picture – Drama, as a producer, and he also received the award for best director from the New York Film Critics Circle. McQueen is the first black filmmaker to win an Academy Award for Best Picture. McQueen is known for his collaborations with actor Michael Fassbender, who has starred in all three of McQueen\'s feature films as of 2013.\nFor his artwork, McQueen has received the Turner Prize, the highest award given to a British visual artist, and in 2006 produced Queen and Country, commemorating the deaths of British soldiers in Iraq by presenting their portraits as a sheet of stamps. For services to the visual arts, he was appointed Commander of the Order of the British Empire in 2011.\nIn April 2014, Time magazine included McQueen in its annual TIME 100 as one of the \"Most Influential People in the World.\"'),('/m/01dgy_','Willie Doherty is an artist from Northern Ireland, who has mainly worked in photography and video. He has twice been a Turner Prize nominee.'),('/m/01fj9_','County Wexford is a county in Ireland. It is part of the South-East Region and is also located in the province of Leinster. It is named after the town of Wexford. In pre-Norman times it was part of the Kingdom of Uí Cheinnselaig, whose capital was at Ferns. Wexford County Council is the local authority for the county. The population of the county is 145,320 according to the 2011 census.'),('/m/01jhv9','Iakovos \"Jake\" Chapman and Konstantinos \"Dinos\" Chapman are English visual artists, often known as the Chapman Brothers, who work together as a collaborative sibling duo. Their subject matter is often deliberately shocking, including, in 2008, a series of works that appropriated original watercolours by Adolf Hitler. In the mid-1990s, their sculptures were included in the YBA showcase exhibitions Brilliant! and Sensation. In 2003, the two were nominated for the annual Turner Prize but lost out to Grayson Perry. In 2013, their painting One Day You Will No Longer Be Loved III was the subject of Derren Brown\'s Channel 4 special, The Great Art Robbery.'),('/m/01l4hs','Elizabeth Eleanor Siddal was an English artists\' model, poet and artist. She was painted and drawn extensively by artists of the Pre-Raphaelite Brotherhood, including Walter Deverell, William Holman Hunt, John Everett Millais and her spouse, Dante Gabriel Rossetti. She featured prominently in Rossetti\'s early paintings of women.'),('/m/01pbb9','County Louth is a county in Ireland. It is part of the Border Region and is also located in the province of Leinster. It is named after the town of Louth. Louth County Council is the local authority for the county. The population of the county is 122,897 according to the 2011 census.'),('/m/01qs54','County Meath is a county in Ireland. It is part of the Mid-East Region and is also located in the province of Leinster. It is named after the ancient Kingdom of Meath. Meath County Council is the local authority for the county. The population of the county is 184,135 according to the 2011 census.'),('/m/01qs5n','Postminimalism is an art term coined by Robert Pincus-Witten in 1971 used in various artistic fields for work which is influenced by, or attempts to develop and go beyond, the aesthetic of minimalism. The expression is used specifically in relation to music and the visual arts, but can refer to any field using minimalism as a critical reference point. In music, postminimalism refers to music following minimal music.'),('/m/01qwfk','Damien Steven Hirst is an English artist, entrepreneur and art collector. He is the most prominent member of the group known as the Young British Artists, who dominated the art scene in the UK during the 1990s. He is internationally renowned, and is reportedly the United Kingdom\'s richest living artist, with his wealth valued at £215m in the 2010 Sunday Times Rich List. During the 1990s his career was closely linked with the collector Charles Saatchi, but increasing frictions came to a head in 2003 and the relationship ended.\nDeath is a central theme in Hirst\'s works. He became famous for a series of artworks in which dead animals are preserved—sometimes having been dissected—in formaldehyde. The best known of these being The Physical Impossibility of Death in the Mind of Someone Living, a 14-foot tiger shark immersed in formaldehyde in a vitrine. He has also made \"spin paintings,\" created on a spinning circular surface, and \"spot paintings\", which are rows of randomly coloured circles created by his assistants.'),('/m/01sxg5','The Exposition Universelle of 1900 was a world\'s fair held in Paris, France, from 15 April to 12 November 1900, to celebrate the achievements of the past century and to accelerate development into the next. The style that was universally present in the Exposition was Art Nouveau. The fair, visited by nearly 50 million, displayed many machines, inventions, and architecture that are now nearly universally known, including the Grande Roue de Paris Ferris wheel, Russian nesting dolls, diesel engines, talking films, escalators, and the telegraphone.'),('/m/01w0yt','Sir John Soane RA was an English architect who specialised in the Neo-Classical style. The son of a bricklayer, he rose to the top of his profession, becoming professor of architecture at the Royal Academy and an official architect to the Office of Works. He received a knighthood in 1831.\nHis architectural works are distinguished by their clean lines, massing of simple form, decisive detailing, careful proportions and skilful use of light sources. The influence of his work, coming at the end of the Georgian era, was swamped by the revival styles of the 19th century. It was not until the late 19th century that the influence of Sir John\'s architecture was widely felt.\nHis best-known work was the Bank of England, a building which had a widespread effect on commercial architecture. He also designed Dulwich Picture Gallery, which, with its top-lit galleries, was a major influence on the planning of subsequent art galleries and museums. His main legacy is Sir John Soane\'s Museum, in Lincoln\'s Inn Fields, London.'),('/m/01xnj','Oscar-Claude Monet was a founder of French Impressionist painting, and the most consistent and prolific practitioner of the movement\'s philosophy of expressing one\'s perceptions before nature, especially as applied to plein-air landscape painting. The term \"Impressionism\" is derived from the title of his painting Impression, soleil levant, which was exhibited in 1874 in the first of the independent exhibitions mounted by Monet and his associates as an alternative to the Salon de Paris.\nMonet\'s ambition of documenting the French countryside led him to adopt a method of painting the same scene many times in order to capture the changing of light and the passing of the seasons. From 1883 Monet lived in Giverny, where he purchased a house and property, and began a vast landscaping project which included lily ponds that would become the subjects of his best-known works. In 1899 he began painting the water lilies, first in vertical views with a Japanese bridge as a central feature, and later in the series of large-scale paintings that was to occupy him continuously for the next 20 years of his life.'),('/m/01zr24','Joseph Kosuth, is an American conceptual artist. He lives in New York and London, after residing in various cities in Europe, including Ghent, Rome and Berlin.'),('/m/01_d4','Chicago is the third most populous city in the United States, after New York City and Los Angeles. With 2.7 million residents, it is the most populous city in both the U.S. state of Illinois and the American Midwest. Its metropolitan area, sometimes called Chicagoland, is home to 9.5 million people and is the third-largest in the United States. Chicago is the seat of Cook County.\nChicago was incorporated as a city in 1837, near a portage between the Great Lakes and the Mississippi River watershed, and experienced rapid growth in the mid-nineteenth century. Today, the city is an international hub for finance, commerce, industry, technology, telecommunications, and transportation, with O\'Hare International Airport being the second-busiest airport in the world; it also has the largest number of U.S. highways, and railroad freight entering its region. In 2012, Chicago was listed as an alpha global city by the Globalization and World Cities Research Network, and ranks seventh in the world in the 2014 Global Cities Index.'),('/m/01_x23','Impression, Sunrise is a painting by Claude Monet. It gave rise to the name of the Impressionist movement.'),('/m/021y7_','Cheapside is a street in the City of London, the historic and modern financial centre of London, which forms part of the A40 London to Fishguard road. It links St. Martin\'s Le Grand with Poultry. Near its eastern end at Bank junction, where it becomes Poultry, is Mansion House, the Bank of England, and Bank station. To the west is St. Paul\'s Cathedral, St. Paul\'s tube station and Paternoster Square.\nIn the Middle Ages, it was known as Westcheap, as opposed to Eastcheap, another street in the City, near London Bridge. The boundaries of the wards of Cheap, Cordwainer and Bread Street run along Cheapside and Poultry; prior to boundary changes in 2003 the road was divided amongst Farringdon Within and Cripplegate wards in addition to the current three.\nThe contemporary Cheapside is widely known as the location of a range of retail and food outlets and offices, as well as the City\'s only major shopping centre, One New Change.'),('/m/022840','American Indian Wars is the name used in the United States to describe the multiple conflicts between American settlers or the federal government and the native peoples of North America from the time of earliest colonial settlement until approximately 1890. In some cases, wars resulted from conflicts and competition for resources between the European colonists and Native Americans. There was population pressure as settlers expanded their territory, generally pushing indigenous people northward and westward. But, warfare and raiding also took place as a result of wars between European powers; in North America, they enlisted their Native American allies to help them conduct warfare against each other\'s settlements.\nMany conflicts were local, involving disputes over land use, and some entailed cycles of reprisal. Particularly in later years, conflicts were spurred by ideologies such as Manifest Destiny, which held that the United States was destined to expand from coast to coast on the North American continent.'),('/m/022hyn','The University of Iceland is a public research university in Reykjavík, Iceland, and the country\'s oldest and largest institution of higher education. Founded in 1911, it has grown steadily from a small civil servants\' school to a modern comprehensive university, providing instruction for about 14,000 students in twenty-five faculties. Subjects covered include social sciences, humanities, medicine, natural sciences, engineering and teacher education. It has a campus concentrated around Suðurgata street in central Reykjavík, with additional facilities located in nearby areas as well as in the countryside.'),('/m/023_m0','The third Paris World\'s Fair, called an Exposition Universelle in French, was held from 1 May through to 10 November 1878. It celebrated the recovery of France after the 1870 Franco-Prussian War.'),('/m/025dvkv','\"Water Lilies\" (1916) is one in a series of water lilies paintings by French artist Claude Monet.'),('/m/025dvlv','Le Parlement (1904) is a painting by French artist Claude Monet.'),('/m/025ycb5','The Shadow of Death is a religious painting by William Holman Hunt, on which he worked from 1870 to 1873, during his second trip to the Holy Land. It depicts Jesus as a young man prior to his ministry, working as a carpenter. He is shown stretching his arms after sawing wood. The shadow of his outstretched arms falls on a wooden spar on which carpentry tools hang, creating a \"shadow of death\" prefiguring the crucifixion. His mother Mary is depicted from behind, gazing up at the shadow, having been looking into a box in which she has kept the gifts given by the Magi.\nIn 1850 Hunt\'s colleague John Everett Millais had already portrayed Jesus as a budding carpenter, helping his father as a young boy. Millais\' painting, Christ in the House of his Parents, had been viciously attacked by critics because of the alleged squalour of the workshop. Hunt repeats many features of Millais\'s painting, but emphasises Jesus\' physical health and muscularity.\nHunt\'s portrayal of Jesus as a hard-working adult craftsman and labourer was also probably influenced by Thomas Carlyle who repeatedly emphasised the spiritual value of honest labour. It also corresponds to the emergence of Muscular Christianity, the view of writers Charles Kingsley, Thomas Hughes and others, who promoted physical strength and health as well as a vigorous pursuit of Christian ideals in personal and political life. Carlyle had strongly criticised Hunt\'s earlier depiction of Jesus in The Light of the World, identifying it as a \"papistical\" picture because it showed Jesus in regal clothing. The portrayal of Mary\'s thriftiness also fits the emphasis on working class financial responsibility promoted by contemporary evangelical publications such as The British Workman.'),('/m/025ylkw','St. Michael Vanquishing Satan is a painting by the Italian High Renaissance painter Raphael.\nIt is a large-scale and mature version of a subject he had earlier treated in the youthful miniature of St. Michael. Both works are located in the Louvre in Paris, France.'),('/m/025yzqx','The Baronci Altarpiece was a painting by the Italian High Renaissance artist Raphael. His first recorded commission, it was made for Andrea Baronci\'s chapel in the church of Sant\'Agostino in Città di Castello, near Urbino. The altarpiece was seriously damaged during an earthquake in 1789, and since 1849 fragments of the original painting have been part of different collections.'),('/m/025z19v','The Mond Crucifixion is a painting by the Italian renaissance artist Raphael.\nAn early work influenced by Perugino, it was originally an altarpiece in the church of San Domenico in Città di Castello, near Raphael\'s hometown of Urbino. The painting shows Jesus on the cross, who is looking peaceful even though he is dying. There are two angels catching his blood in chalices. On Jesus\' left kneels Mary Magdalene, with John the Evangelist standing behind her. On his right Mary stands, and St. Jerome, to whom the altar was dedicated, is kneeling. At the foot of the cross is the inscription RAPHAEL/ VRBIN / AS /.P.[INXIT] in silver letters.\nThe painting was bequeathed to the National Gallery by Ludwig Mond.\nThe sun and moon at the top are present despite the Council of Constantinople prohibition of such symbology for its reference to other religions.'),('/m/025_ccf','The Vision of the Cross is a painting made between 1520 and 1524 by assistants of the Italian renaissance artist Raphael. After the master\'s death in 1520, Gianfrancesco Penni, Giulio Romano and Raffaellino del Colle from Raphael\'s workshop worked together to finish the commission to decorate with frescoes the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican.\nThe Vision of the Cross is located in the Sala di Costantino. In the painting, emperor Constantine I is seen just before the Battle of the Milvian Bridge on October 28, 312. According to legend, a cross appeared to Constantine in the sky, after which as seen in the fresco and following Eusebius of Caesarea Vita Constantini, he adopted the Greek motto \"Εν τούτῳ νίκα\", i.e. \"By this, conquer\", a motto that has been rendered in Latin as \"In hoc signo vinces\", i.e. \"In this sign you shall conquer\".\nThis Mannerist painting is a crowded and confused melee and melange of images, including a dragon, a dwarf, two popes, and various symbols. Proportions among the soldiers appear confused, with some dwarfed by more distant figures.'),('/m/0260bj0','The Mass at Bolsena is a painting by the Italian renaissance artist Raphael. It was painted between 1512 and 1514 as part of Raphael\'s commission to decorate with frescoes the rooms that are now known as the Raphael Rooms, in the Apostolic Palace in the Vatican. It is located in the Stanza di Eliodoro, which is named after The Expulsion of Heliodorus from the Temple.\nThe Mass at Bolsena shows an incident that is said to have taken place in 1263. A Bohemian priest who doubted the doctrine of transubstantiation, celebrated mass at Bolsena, where the bread of the eucharist began to bleed. The following year, in 1264, Pope Urban IV instituted the Feast of Corpus Christi to celebrate this miraculous event. Bolsena is north of Rome and the priest who doubted was a German. He was taking mass and when he doubted the Transubstantiation, blood spouted from the host and fell onto the tablecloth in the shape of a cross and he was reconverted.\nPresent in this painting is a self-portrait of the artist, Raphael, as one of the Swiss Guard in the lower right of the fresco, facing out with bound-up hair. This is one of several instances in which Raphael has placed himself in his paintings.'),('/m/0260xqn','The Battle of Ostia is a painting by the workshop of the Italian renaissance artist Raphael. The painting was part of Raphael\'s commission to decorate the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican. It is located in the room that was named after The Fire in the Borgo, the Stanza dell\'incendio del Borgo and was inspired by the naval battle fought in 849 between the Saracens and a Christian League of Papal, Neapolitan and Gaetan ships. In the painting Pope Leo IV, with the features of Pope Leo X, is giving thanks after the Arab ships were destroyed by a storm.'),('/m/02618mv','The Oath of Leo III is a painting by the workshop of the Italian renaissance artist Raphael. The painting was part of Raphael\'s commission to decorate the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican. It is located in the room that was named after The Fire in the Borgo, the Stanza dell\'incendio del Borgo. In the fresco, Pope Leo III is seen during the trial on December 23 AD 800 during which he was brought face to face with the nephews of his predecessor Pope Hadrian I, who had accused him of misconduct. The assembled bishops declared that they could not judge the pope, after which Leo took an oath of purgation of his own free will.'),('/m/02624w6','The Sybils, or Sybils receiving instruction from Angels, is a painting by the Italian renaissance artist Raphael. It was painted in 1514, as part of a commission Raphael had received from the papal banker Agostino Chigi to decorate the interior of Santa Maria della Pace in Rome.'),('/m/0263z02','Saint Catherine of Alexandria is a painting by the Italian Renaissance artist Raphael. In the painting, Catherine of Alexandria is looking upward in ecstasy and leaning on a wheel - an allusion to the breaking wheel of her martyrdom.\nIt was painted circa 1507, shortly after Raphael\'s arrival in Florence and shows the young artist in a transitional phase. The depiction of religious passion in the painting is still reminiscent of Pietro Perugino. But the graceful contrapposto of Catherine\'s pose is typical of the influence of Leonardo da Vinci on Raphael, and is believed to be an echo of Leonardo\'s lost painting Leda and the Swan.\nThis picture was partially used on the cover of The Smashing Pumpkins album Mellon Collie and the Infinite Sadness.'),('/m/0264r0p','Campbell\'s Soup Cans, which is sometimes referred to as 32 Campbell\'s Soup Cans, is a work of art produced in 1962 by Andy Warhol. It consists of thirty-two canvases, each measuring 20 inches in height × 16 inches in width and each consisting of a painting of a Campbell\'s Soup can—one of each of the canned soup varieties the company offered at the time. The individual paintings were produced by a printmaking method—the semi-mechanized screen printing process, using a non-painterly style. Campbell\'s Soup Cans\' reliance on themes from popular culture helped to usher in pop art as a major art movement in the United States.\nWarhol, a commercial illustrator who became a successful author, publisher, painter, and film director, showed the work on July 9, 1962, in his first one-man gallery exhibition as a fine artist in the Ferus Gallery of Los Angeles, California. The exhibition marked the West Coast debut of pop art. The combination of the semi-mechanized process, the non-painterly style, and the commercial subject initially caused offense, as the work\'s blatantly mundane commercialism represented a direct affront to the technique and philosophy of abstract expressionism. In the United States the abstract expressionism art movement was dominant during the post-war period, and it held not only to \"fine art\" values and aesthetics but also to a mystical inclination. This controversy led to a great deal of debate about the merits and ethics of such work. Warhol\'s motives as an artist were questioned, and they continue to be topical to this day. The large public commotion helped transform Warhol from being an accomplished 1950s commercial illustrator to a notable fine artist, and it helped distinguish him from other rising pop artists. Although commercial demand for his paintings was not immediate, Warhol\'s association with the subject led to his name becoming synonymous with the Campbell\'s Soup Can paintings.'),('/m/0265mk8','Portrait of Seymour H. Knox is a 1985 portrait by Andy Warhol of Seymour H. Knox II. It was donated by the families of his two sons, Mr. and Mrs. Seymour H. Knox III and Mrs. and Mrs. Northrup R. Knox, to the Albright-Knox Art Gallery in honor of Seymour H. Knox II for his 60 year contribution as a member of the Buffalo Fine Arts Academy.\nThis is one of a number of celebrity portraits that Warhol produced in this duplicative multicolored style. Many were produced in his early 1960s silkscreen period. Some of the major celebrity portraits of this style include those of Elvis Presley, Elizabeth Taylor, Marilyn Monroe, Jacqueline Kennedy, Mao Zedong and Andy Warhol himself. He also produced similar style works of several other minor celebrities.'),('/m/0268dw6','The Order of Release, 1746 is a painting by John Everett Millais exhibited in 1853. It is notable for marking the beginnings of Millais\'s move away from the highly detailed Pre-Raphaelitism of his early years. Effie Gray, who later left her husband for the artist, modelled for the principal figure.\nThe painting depicts the wife of a rebel Scottish soldier, who has been imprisoned after the Jacobite rising of 1745, arriving with an order securing his release. She holds her child, showing the order to a guard, while her husband embraces her.\nThe Illustrated London News reviewed the painting as follows:\nThe dark, generalised background is a departure from the highly detailed backgrounds of earlier works such as Ophelia, as is the emphatic chiaroscuro. However, the portrayal of tense relationships disrupted by historical dramas was a continuation of the theme of A Huguenot and The Proscribed Royalist, 1651.\nWhile working on the painting, Millais fell in love with Effie, the wife of his principal supporter, the critic John Ruskin. A study for the painting has a drawing of her head on one side and an image of a man kneeling in supplication to a woman on the other, labelled \"accepted\".'),('/m/0268v1d','Christ in the House of His Parents is a painting by John Everett Millais depicting the Holy Family in Saint Joseph\'s carpentry workshop. The painting was extremely controversial when first exhibited, prompting many negative reviews, most notably one written by Charles Dickens. It catapulted the previously obscure Pre-Raphaelite Brotherhood to notoriety and was a major contributor to the debate about Realism in the arts.\nIt is currently housed in the Tate Britain in London.'),('/m/026zf3n','St. George or St. George and the Dragon is a small painting by the Italian Renaissance artist Raphael. It is housed in the Louvre in Paris. A later version of the same subject is the St. George in the National Gallery of Art in Washington, D.C.'),('/m/027f3lf','Dr. David Fleming was an independent thinker and writer on environmental issues, based in London, England. He was one of the whistle blowers on the possibility of peak oil\'s approach and the inventor of the influential TEQs scheme, designed to address this and climate change.\nHe was also a significant figure in the development of the UK Green Party, the Transition Towns movement and the New Economics Foundation, as well as a Chairman of the Soil Association.'),('/m/027ghtv','The Story of the Glittering Plain is an 1891 fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It is also important for its exploration of the socialist themes that interested Morris.\nHis earlier fantasies The House of the Wolfings and The Roots of the Mountains were to some degree historical novels. Like these The Story of the Glittering Plain is set in a world similar to the distant past of northern Europe. Morris would go on to develop the new genre established in this work in such later fantasies as Child Christopher and Goldilind the Fair, The Wood Beyond the World, The Well at the World\'s End, and The Water of the Wondrous Isles.'),('/m/0282bhv','State Britain is an installation artwork by Mark Wallinger displayed in Tate Britain in January 2007. It is a recreation from scratch of a protest display about the treatment of Iraq, set up by Brian Haw outside Parliament and eventually confiscated by the police. Haw\'s display contained several hundred items donated by members of the public. As well as continuing the protest, Wallinger\'s recreation in a different context also brings up questions of authenticity. Wallinger won the Turner Prize in 2007 for this piece.'),('/m/028yy7','The fuel protests in the United Kingdom were a series of campaigns held because of the cost of rising petrol and Diesel fuel prices for road vehicle use. There have been three notable campaigns amongst many other protests in the 21st century. The first major protest in 2000 was primarily led by independent truck owner operators, farmers and the public. One group of truck owner operators from the South East of England formed a protest group calling themselves \"TransAction\" who protested at oil refineries and fuel depots in Essex. Protests and Blockades of oil facilities caused widespread disruption to the supply of petroleum products, with knock-on effects for the public and the authorities, as well as causing a reduction in popularity for the incumbent government. The aim of the protests was to secure a reduction in the fuel duty rate on petrol and diesel, which the government refused to enact. After the protest ended, the government did announce a freeze on fuel duties, and promised changes would be made to the way that goods vehicles were taxed, which would include the taxing of foreign vehicles operating on British roads. As at 2012, fuel duty continues to increase and foreign trucks entering the UK still travel the roads free of charge.'),('/m/02cft','Dublin is the capital of Ireland. Dublin is in the province of Leinster on Ireland\'s east coast, at the mouth of the River Liffey.\nFounded as a Viking settlement, the Kingdom of Dublin became Ireland\'s principal city following the Norman invasion. The city expanded rapidly from the 17th century and was briefly the second largest city in the British Empire before the Act of Union in 1800. Following the partition of Ireland in 1922, Dublin became the capital of the Irish Free State and later the Republic of Ireland.\nDublin is administered by a City Council. The city is listed by the Globalization and World Cities Research Network as a global city, with a ranking of \"Alpha-\", placing it among the top thirty cities in the world. It is a historical and contemporary centre for education, the arts, administration, economy and industry.'),('/m/02pngf2','The Physical Impossibility of Death in the Mind of Someone Living is an artwork created in 1991 by Damien Hirst, an English artist and a leading member of the \"Young British Artists\". It consists of a tiger shark preserved in formaldehyde in a vitrine. It was originally commissioned in 1991 by Charles Saatchi, who sold it in 2004, to Steven A. Cohen for an undisclosed amount, widely reported to have been $8 million. However, the title of Don Thompson\'s book, The $12 Million Stuffed Shark: The Curious Economics of Contemporary Art, suggests a higher figure.\nOwing to deterioration of the original 14-foot tiger shark, it was replaced with a new specimen in 2006. It was on loan to the Metropolitan Museum of Art in New York City from 2007 to 2010.\nIt is considered the iconic work of British art in the 1990s, and has become a symbol of Britart worldwide.'),('/m/02prvdf','The Love Potion is a 1903 painting by Evelyn De Morgan depicting a witch with a black cat familiar at her feet.\nAccording to Elise Lawton Smith, the painting \"exhibits a Pre-Raphaelite fascination with medieval subjects and decorative detailing.\"'),('/m/02q698k','April Love is a painting by the Pre-Raphaelite painter Arthur Hughes which was created between 1855 and 1856. It was first exhibited at the Royal Academy of Arts in 1856.\nAt its first showing Hughes accompanied the painting with an extract from Tennyson\'s poem \"The Miller\'s Daughter\":\nLove is hurt with jar and fret,\nLove is made a vague regret,\nEyes with idle tears are set,\nIdle habit links us yet;\nWhat is Love? For we forget.\nAh no, no.\nOriginally acquired by William Morris, the painting was purchased by the Tate Gallery, London in 1909 and has remained in the Tate collection to the present day.\nIt shows a distinctly Pre-Raphelite style in which a soft approach to nature and feminity is found. Bright colors and red-haired women as well as an emphasis on nature and symbolism characterize this style which can be found in the late 1800s as a response to industrialization.\nThe painting depicts a young couple at a moment of emotional crisis. The male figure is barely visible, his head bent over the young woman\'s left hand. The woman is looking down at fallen blossoms, suggesting the end of spring, and of early and young love.'),('/m/02q6xp7','The Long Engagement is a painting by the Pre-Raphaelite artist Arthur Hughes which was created between 1854 and 1859. The painting was originally titled \"Orlando\".\nThe painting depicts a curate and his fiancée in a woodland setting.\nThe title refers to middle class social conventions of the time, in particular the fact that the parents of a girl engaged to a poorly paid curate would typically not allow the marriage until he had secured a more remunerative position - i.e. within the church hierarchy. The girl is depicted looking at her own name carved, some while ago, into the trunk of the tree by her fiancé as an expression of his love. The carving, however, is about to be covered by rambling ivy - growing up the trunk; ethereal youthful passion is becoming lost to lassiez-faire worldly capitalist demands. It can be said that this symbolism reflects the stark realities of late 1850s and 1860s Victorian England, which certainly is the observation made by English historian A. N. Wilson. In his book The Victorians, Wilson makes the following observation and analysis of the significance of The Long Engagement:\nIt depicts an emotional predicament stemming directly from an economic situation. The prosperity which had created the vast bourgeoisie with its gradations from lower to upper middle class had also created a code. You could not marry, and maintain the position in society to which you aspired, until you had a certain amount of money in the bank.'),('/m/02q6y95','The Beguiling of Merlin is a painting by the Pre-Raphaelite painter Edward Burne-Jones which was created between 1872 and 1877.\nThe painting depicts a scene from Arthurian legend, the infatuation of Merlin with the Lady of the Lake, Nimue. Merlin is shown trapped, helpless in a hawthorn bush as Nimue reads from a book of spells.\nThe work was commissioned from Burne-Jones by Frederick Richards Leyland, a Liverpool ship-owner and art-collector, in the late 1860s. After a false start blamed on \"poor materials\" Burne-Jones began work on the painting proper in 1873, finishing the body of the work by the end of 1874; although the painting was not first exhibited until 1877 at the opening exhibition of the Grosvenor Gallery in London.\nBurne-Jones used Maria Zambaco, who was probably his mistress from 1866 to 1872, for the model for the head of Nimue.\nThe painting was purchased by Lord Leverhulme in 1918 and remains in the Lady Lever Art Gallery to the present day.\nThe painting features on the cover of the novel Possession: A Romance by A. S. Byatt and The Last Pre-Raphaelite by Fiona MacCarthy It also plays a significant role in King Solomon\'s Carpet by Ruth Rendell writing as Barbara Vine.'),('/m/02q6y_j','Convent Thoughts is a painting by the Pre-Raphaelite painter Charles Allston Collins which was created between 1850 and 1851. Collins sent it to the Royal Academy of Arts in 1851 where it was exhibited.\nThe painting shows a nun contemplating a passion flower symbolising the crucifixion of Christ. She is standing in a walled garden full of minutely detailed flowers. In her left hand she holds an illuminated missal, held not as though she had been reading it but so as to show us the Annunciation and the Crucifixion. Her costume shows that she is a novice, presumably meditating on her final vows.\nThe flowers were painted in the Oxford garden of Thomas Combe, an early collector of Pre-Raphaelite paintings. Combe bought the painting; in 1894 he bequeathed his art collection to the Ashmolean Museum, Oxford and Convent Thoughts remains in the Museum\'s collection to the present day.\nAlthough Collins was never formally a member of the Pre-Raphaelite Brotherhood, he was in sympathy with their aims and painted in their immensely detailed style. Convent Thoughts has a place in the history of Pre-Raphaelitism, because the tide of opinion, initially hostile, was to some extent turned by a letter to The Times on 13 May 1851 from the influential critic John Ruskin praising the Pre-Raphaelite paintings at the Academy exhibition, in particular Convent Thoughts, about which he wrote:'),('/m/02q78bm','Bubbles, originally titled A Child\'s World, is a painting by Sir John Everett Millais that became famous when it was used over many generations in advertisements for Pears soap. During Millais\'s lifetime it led to widespread debate about the relationship between art and advertising.\nThe painting was one of many child pictures for which Millais had become well known in his later years. It was modelled by his five-year-old grandson William Milbourne James and was based on 17th-century Dutch precursors in the tradition of vanitas imagery, which commented upon the transience of life. These sometimes depicted young boys blowing bubbles, typically set against skulls and other signs of death.\nThe painting portrays a young golden-haired boy looking up at a bubble, symbolising the beauty and fragility of life. On one side of him is a young plant growing in a pot, emblematic of life, and on the other is a fallen broken pot, emblematic of death. He is spot-lit against a gloomy background.\nThe painting was first exhibited in 1886 under the title A Child\'s World at the Grosvenor Gallery in London, and was acquired by Sir William Ingram of the Illustrated London News. The painting was reproduced and presented in the weekly newspaper as a colour plate, where it was seen by Thomas J. Barratt, managing director of A&F Pears. Barratt purchased the original painting from Ingram for £2,200 which gave him exclusive copyright on the picture. Millais\' permission was sought in order to alter the picture by the addition of a bar of Pears Soap, so that it could be used for the purposes of advertising. At the time Millais was one of the most popular artists in Britain and he was initially apprehensive at the prospect of his work and his grandson being the subject of commercial exploitation. However, when he was shown the proofs of the proposed advertisements he grew to appreciate the idea, which portrayed the soap as if the child had used it to make the bubbles. Following the success of this advertisement Millais was attacked in print by the novelist Marie Corelli who accused him in her novel The Sorrows of Satan of prostituting his talent to sell soap. Millais wrote to her pointing out that he had sold the copyright of the painting and so was unable to stop the company from altering it in reproduction. Millais\'s son later claimed that he had tried to stop the advertisement being made, but had been advised that he had no legal power to do so. Corelli retracted her comments in a later edition of the book.'),('/m/02q7hpb','Medea is an oil painting on canvas by the Pre-Raphaelite painter Frederick Sandys which was created in 1868. The painting was submitted to the Royal Academy of Arts for display in the Summer Exhibition of 1868 but it was rejected - most likely for political rather than artistic reasons. The picture was accepted the following year and reviewed very favourably by The Times, which commented pointedly on its previous failure to win a place.\nMedea was modelled on Keomi Gray, a gypsy woman whom Sandys had met in Norwich, England, and taken back to London to sit for many of his paintings. According to a contemporary critic it shows the enchantress Medea \"...in the act of incantation, the baleful light of her chafing-dish playing in the folds of her robe, and making the pale cheeks look paler, and the ashy lips more ashy, and kindling the array of foul ingredients and witch\'s properties that surround her tripod - foul toads and strange roots, and images of strange gods, and quaint shells filled with evil compounds.\"\nIn 1911 the picture was among paintings representative of the best British art sent to Italy for the international exhibition at Rome held in honour of the jubilee of the Kingdom of Italy.'),('/m/02q7_bm','A Dream of the Past: Sir Isumbras at the Ford is a painting by John Everett Millais depicting a medieval knight helping two young peasant children over a swollen river. The children are carrying heavy burdens of wood for winter fuel. Though the title refers to the medieval poem Sir Isumbras, the painting does not illustrate a scene from the original text. However Millais\'s friend, the writer Tom Taylor, wrote verse in a pastiche of the original poem, describing the event depicted. This was included in the original exhibition catalogue.\nWhen first exhibited the painting was extremely controversial, and was attacked by many critics. Most notably, Millais\'s former supporter John Ruskin declared it to be a \"catastrophe\". The painting was also satirised in a print by Frederic Sandys, entitled \"A Nightmare\", in which Millais himself was represented as the knight. His fellow Pre-Raphaelites Dante Gabriel Rossetti and William Holman Hunt were caricatured as the children, and the horse—transformed into a donkey—was branded with the initials of Ruskin.'),('/m/02q8h_x','Autumn Leaves is a painting by John Everett Millais exhibited at the Royal Academy in 1856. It was described by the critic John Ruskin as \"the first instance of a perfectly painted twilight.\" Millais\'s wife Effie wrote that he had intended to create a picture that was \"full of beauty and without a subject\".\nThe picture depicts four girls in the twilight collecting and raking together fallen leaves in a garden. They are making a bonfire, but the fire itself is invisible, only smoke emerging from between the leaves. The two girls on the left, modelled on Millias\' sisters-in-law Alice and Sophy Gray, are portrayed in middle class clothing of the era; the two on the right are in rougher, working class clothing.\nThe painting has been seen as one of the earliest influences on the development of the aesthetic movement.'),('/m/02q93kw','Peace Concluded, 1856 is a painting by John Everett Millais which depicts a wounded British officer reading The Times newspaper\'s report of the end of the Crimean War. It was exhibited at the Royal Academy in 1856 to mixed reviews, but was strongly endorsed by the critic John Ruskin who proclaimed that in the future it would be recognised as \"among the world\'s best masterpieces\". The central figure in the painting is a portrait of Millais\'s wife Effie Gray, who had previously been married to Ruskin.'),('/m/02q94q9','The Blind Girl is a painting by John Everett Millais which depicts two itinerant beggars, presumed to be sisters, one of whom is a blind musician, her concertina on her lap. They are resting by the roadside after a rainstorm, before travelling to the town of Winchelsea, visible in the background.\nThe painting has been interpreted as an allegory of the senses, contrasting the experiences of the blind and sighted sisters. The former feels the warmth of the sun on her face, and fondles a leaf of grass, while the latter shields her eyes from the sun or rain and looks at the unusual spectacle of a double rainbow that has just appeared. Some critics have interpreted the rainbow in Biblical terms, as the sign of God\'s covenant described in Genesis 9:16.\nWhen the painting was first exhibited in 1856 it was pointed out to Millais that in double rainbows the inner rainbow inverts the order of the colours. Millais had originally painted the colours in the same order in both rainbows. He altered it for scientific accuracy.\nA tortoiseshell butterfly rests on the blind girl\'s shawl, implying that she is holding herself extremely still. The sheet around her neck is captioned \"Pity the Blind\".'),('/m/02q95m6','Vanessa is a painting by John Everett Millais in Sudley House, Liverpool. It is a fancy portrait depicting Jonathan Swift\'s correspondent Esther Vanhomrigh, who was known by that pseudonym.\nVanessa represents a major departure in Millais\'s art because he abandons fully for the first time the detailed finish that was still to be seen in Waking and Sleeping, exhibited in the previous year. Influenced by the work of Diego Velázquez and Joshua Reynolds, Millais paints with dramatic, visible brush strokes in vivid colours, creating what has been described as an \"almost violently modern\" handling of paint.\nEsther Vanhomrigh is known as \"Swift\'s Vanessa\" because of the fictional name he gave her when he published their correspondence. The portrait is wholly imaginary. No actual image of Esther Vanhomrigh exists. She is holding a letter, presumably written to or from Swift. Her sad expression is related to the fraught nature of the relationship, which was broken up by Swift\'s relationship to another woman, Esther Johnson whom he called \"Stella\". Millais also painted a companion piece depicting Stella.\nThe painting is part of the 18th century revival in British art at this time, when a renewed interest in the brushwork of Reynolds and Gainsborough was emerging.'),('/m/02q96cn','Isabella, also known as Lorenzo and Isabella, is a painting by John Everett Millais, which was his first work in the Pre-Raphaelite style, created shortly after the formation of the Pre-Raphaelite Brotherhood in the previous year. It was first exhibited at the Royal Academy in 1849, and is now in the collection of the Walker Art Gallery in Liverpool.'),('/m/02q9dpx','Esther is a painting by John Everett Millais depicting the central character from the Biblical Book of Esther. It is from Millais\'s Aesthetic phase, when he was influenced by the work of Frederic Leighton and James McNeill Whistler.\nThe painting depicts Esther, the Jewish wife of the Persian king Ahasuerus, as she prepares to enter the presence of her husband. As she is uninvited, she risks death, but does so to inform him of a plot against the Jews.\nMillais borrowed the Yellow Jacket, a gown given to General Gordon by the Chinese emperor after his defeat of the Taiping rebellion. In order to create a culturally unspecific effect, he turned it inside out, producing the abstract patterns visible in the painting.\nMillais creates a dramatic visual effect by vivid contrasts of colours, setting the deep blue of the curtain against the yellow dress and the white columns. The minimising of the narrative aspect of the scene is also in line with the Aestheticist approach of the artists he is imitating and challenging.\nEsther is depicted adjusting pearls in her hair, as she prepares to place her crown on her head. This gesture is derived from paintings by Titian, whose techniques of colouring Millais imitates, along with the modelling of the face and the characteristic \"Titian blonde\" hair. This also compares with the lush red locks of Millais\'s earlier picture The Bridesmaid and with some contemporary works by Dante Gabriel Rossetti. Millais\'s biographer Marion Spielmann wrote that the painting was \"the most modernly treated of Millais\'s early works...more consonant in its strong harmony with the audacious brilliancy of the present day [1898] than the more solid strength of forty years ago.\"'),('/m/02q9k_q','The Scapegoat is a painting by William Holman Hunt which depicts the \"scapegoat\" described in the Book of Leviticus. On the Day of Atonement, a goat would have its horns wrapped with a red cloth – representing the sins of the community – and be driven off.\nHe started painting on the shore of the Dead Sea, and continued in his studio in London. The work exists in two versions, a small version in brighter colours with a dark-haired goat and a rainbow, held by Manchester Art Gallery, and a larger version in more muted tones with a light-haired goat held by the Lady Lever Art Gallery in Port Sunlight.'),('/m/02q9m89','The Meeting of Leo I and Attila is a fresco by the Italian Renaissance artist Raphael and his assistant Giulio Romano. It was painted in 1514 as part of Raphael\'s commission to decorate the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican. It is located in the Stanza di Eliodoro, which is named after The Expulsion of Heliodorus from the Temple.\nThe painting depicts the meeting between the Pope Leo I and Attila the Hun, and includes the images of Saint Peter and Saint Paul in the sky bearing swords. Initially, Raphael depicted Leo I with the face of Pope Julius II but after Julius\' death, Raphael changed the painting to resemble the new pope, Leo X.'),('/m/02qblb6','The Rescue is a painting by John Everett Millais depicting a fireman rescuing three children from a house fire, with their mother receiving them back into her arms.\nMillais witnessed the death of a fireman in the course of a rescue, and decided to depict the subject. The fire brigade had only recently been transformed from private businesses dedicated to the protection of property to a public institution charged to protect life first.\nMillais sought to create the correct effects of light and smoke by using a sheet of coloured glass and by burning planks of wood. This emphasis on fleeting effects of colour and light was a new departure in his art.\nThe painting is also notable for its startling transitions of colour, particularly the dramatic effect by which the sleeve of the mother\'s nightgown changes from slatey blue to pale pink. This led to much critical comment at the time.\nRobyn Cooper argues that some criticism of the painting arose from the fact that it depicted a virile working class man rescuing middle class children, while their father is nowhere to be seen. The mother\'s opened arms seem to greet this strong new man as much as her children.'),('/m/02qc2m9','The Holy Family is an oil painting on canvas of the Holy Family by the Pre-Raphaelite artist James Collinson. The painting dates from 1878 when the artist was living in Brittany. The town in the background may be Saint-Malo.\nThe scene is of Jesus as an infant, with his earthly father Joseph and mother Mary. The specific scene does not appear in the Biblical Gospels, but it has many precedents in Renaissance art. The dove typically represents the Holy Spirit, who took this form at the baptism of Jesus.\nThe extremely detailed depiction of the growing flora is closely comparable to Collinson\'s early Pre-Raphaelite work, and differs from his other paintings from this period.'),('/m/02qd3kl','A Huguenot, on St. Bartholomew\'s Day, Refusing to Shield Himself from Danger by Wearing the Roman Catholic Badge is a painting by John Everett Millais. The long title is usually abbreviated to A Huguenot or A Huguenot on St Bartholomew\'s Day.\nIt depicts a pair of young lovers in an embrace. The familiar subject is given a dramatic twist because the \"embrace\" is in fact an attempt by the girl to get her beloved to wear a white armband, declaring his allegiance to Roman Catholicism. The young man gently pulls the armband off with the same hand with which he embraces the girl. The incident refers to the St. Bartholomew\'s Day massacre in 1572 when French Protestants were massacred in Paris, leading to other massacres elsewhere in France. A small number of Protestants escaped from the city by wearing white armbands.\nMillais had initially planned simply to depict lovers, but had been persuaded by his Pre-Raphaelite colleague William Holman Hunt that the subject was too trite. After seeing Giacomo Meyerbeer\'s opera Les Huguenots, which tells the story of the massacre, Millais adapted the painting to refer to the event. In the opera the character Valentine also attempts unsuccessfully to get her lover Raoul to wear the armband. The choice of a pro-Protestant subject was also significant because the Pre-Raphaelites had previously been attacked for their alleged sympathies to the Oxford Movement and to Catholicism.'),('/m/02qd8fd','The Miracle of the Holy Fire is a painting by William Holman Hunt which depicts the Greek Orthodox rite of the Holy Fire in the Church of the Holy Sepulchre Jerusalem. Hunt believed the fire to be a pious fraud which brought Christianity into disrepute. He intended the painting to be a satire in the manner of William Hogarth. Hunt published an elaborate keyplate explaining the identity of the various characters depicted.'),('/m/02qdc32','Boreas is an oil painting in the Pre-Raphaelite style created in 1903 by John William Waterhouse.'),('/m/02qdn3t','Jason and Medea is an oil painting in the Pre-Raphaelite style created by John William Waterhouse in 1907.\nThe painting depicts the Colchian princess, Medea, preparing a magic potion for Jason to enable him to complete the tasks set for him by her father, Aeëtes.\nMedea\'s determined facial expression shows a characterization consistent with that of Greek literature, particularly Euripides\' tragedy Medea.\nThe painting is thematically and visually similar to The Magic Circle.'),('/m/02qdn8z','The Magic Circle is an oil painting in the Pre-Raphaelite style, created in 1886 by John William Waterhouse. The painting depicts a witch or sorceress drawing a fiery magic circle on the earth to create a ritual space.'),('/m/02qdrky','A Vision of Fiammetta is an oil painting in the Pre-Raphaelite which was created by Dante Gabriel Rossetti in 1878. The painting was one half of one of Rossetti\'s \"double works\", accompanying his Ballads and Sonnets. Maria Spartali Stillman modelled for the painting. The subject of painting is Boccacio\'s muse named Fiammetta.'),('/m/02qf5q7','The Proscribed Royalist, 1651 is a painting by John Everett Millais which depicts a young Puritan woman protecting a fleeing Royalist after the Battle of Worcester in 1651, the decisive defeat of Charles II by Oliver Cromwell. The Royalist is hiding in a hollow tree, a reference to a famous incident in which Charles himself hid in a tree to escape from his pursuers. Millais was also influenced by Vincenzo Bellini\'s opera I Puritani.\nMillais painted the picture in Hayes, Kent, from a local oak tree that became known as the Millais Oak.'),('/m/02qq7d4','The Finding of the Saviour in the Temple is a painting by William Holman Hunt intended as an ethnographically accurate version of the subject traditionally known as \"Christ Among the Doctors\", an illustration of the child Jesus debating the interpretation of the scripture with learned rabbis. The passage illustrated is from the Gospel of Luke, 2:41, which states:\nEvery year his parents went to Jerusalem for the Feast of the Passover. When he was twelve years old, they went up to the Feast, according to the custom. After the Feast was over, while his parents were returning home, the boy Jesus stayed behind in Jerusalem, but they were unaware of it. Thinking he was in their company, they traveled on for a day. Then they began looking for him among their relatives and friends. When they did not find him, they went back to Jerusalem to look for him. After three days they found him in the temple courts, sitting among the teachers, listening to them and asking them questions. Everyone who heard him was amazed at his understanding and his answers. When his parents saw him, they were astonished. His mother said to him, \"Son, why have you treated us like this? Your father and I have been anxiously searching for you.\" \"Why were you searching for me?\" he asked. \"Didn\'t you know I had to be in my Father\'s house?\" But they did not understand what he was saying to them.'),('/m/02r974w','The Wood Beyond the World is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature.\nIt was first published in hardcover by Morris\'s Kelmscott Press in 1894. Its importance in the history of fantasy literature was recognized by its republication by Ballantine Books as the third volume of the celebrated Ballantine Adult Fantasy series in July, 1969. The Ballantine edition includes an introduction by Lin Carter.'),('/m/02r975k','The Water of the Wondrous Isles is a fantasy novel by William Morris, perhaps the first writer of modern fantasy to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first printed in 1897 by Morris\' own Kelmscott Press on vellum and artisanal paper in a blackletter type of his own design. For the wider reading public, a hardcover trade edition was published later that year by Longmans, Green and Co. The novel\'s importance in the history of fantasy literature was recognized by its republication by Ballantine Books as the thirty-eighth volume of the celebrated Ballantine Adult Fantasy series in November, 1971. The Ballantine edition includes an introduction by Lin Carter.\nMorris considered his fantasies a revival of the medieval tradition of chivalrous romances; in consequence, they tend to have sprawling plots of strung-together adventures. These prose romances were written in a mock-Medieval style which some modern readers may find onerous.'),('/m/02r9767','The Sundering Flood is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. The Sundering Flood was Morris\' last work of fiction, completed only in rough draft, with the ending dictated from his deathbed. It was edited by his daughter May into finished form for publication.\nMorris considered his fantasies a revival of the medieval tradition of chivalrous romances; consequently, they tend to have sprawling plots of strung-together adventures. His use of archaic language has been seen as difficult by some modern readers.'),('/m/02rcj1p','This sortable table is intended to list railway accidents in the Republic of Ireland, and before its formation accidents in the provinces of Leinster, Munster and Connacht, plus the counties of Donegal, Cavan and Monaghan. It is currently limited to accidents where at least one train occupant was killed. It does not include acts of terror, nor accidents in Northern Ireland.'),('/m/02rft35','Isabella and the Pot of Basil is a painting completed in 1868 by William Holman Hunt depicting a scene from John Keats\'s poem Isabella, or the Pot of Basil. It depicts the heroine Isabella caressing the basil pot in which she had buried the severed head of her murdered lover Lorenzo.\nHunt had drawn an illustration to the poem in 1848, shortly after the foundation of the Pre-Raphaelite Brotherhood, but he had not developed it into a completed painting. The drawing portrayed a very different scene, depicting Lorenzo as a clerk at work while Isabella\'s brothers study their accounts and order around underlings.\nHunt returned to the poem in 1866, shortly after his marriage, when he began to paint several erotically charged subjects. His sensuous painting Il Dolce Far Niente had sold quickly, and he conceived the idea for a new work depicting Isabella. Having travelled with his pregnant wife Fanny to Italy, Hunt began work on the painting. However, after giving birth, Fanny died from fever in December 1866. Hunt turned the painting into a memorial to his wife, using her features for Isabella.'),('/m/02rh97y','For the Love of God is a sculpture by artist Damien Hirst produced in 2007. It consists of a platinum cast of an 18th-century human skull encrusted with 8,601 flawless diamonds, including a pear-shaped pink diamond located in the forehead that is known as the Skull Star Diamond. The skull\'s teeth are original, and were purchased by Hirst in London. The artwork is a Memento mori, or reminder of the mortality of the viewer. In 2007, art historian Rudi Fuchs, observed: \'The skull is out of this world, celestial almost. It proclaims victory over decay. At the same time it represents death as something infinitely more relentless. Compared to the tearful sadness of a vanitas scene, the diamond skull is glory itself.\' Costing £14 million to produce, the work was placed on its inaugural display at the White Cube gallery in London in an exhibition Beyond belief with an asking price of £50 million. This would have been the highest price ever paid for a single work by a living artist. According to Art Knowledge News, a sale was being completed at the $100 million asking price.[citation needed]'),('/m/02rhv7r','The Portrait of Smeralda Brandini is a tempera on panel painting by the Italian Renaissance artist Sandro Botticelli of about 1475, in the Victoria and Albert Museum, London.'),('/m/02rhv9t','The Madonna and Child with Three Angels is a painting by the Italian Renaissance master Sandro Botticelli, executed in 1493. It is housed in the Pinacoteca Ambrosiana of Milan.\nThe Virgin Mary is portrayed while giving her breast to the Child, the latter being supported by an angel. The Italian name derives from the rich baldachin over the scene.'),('/m/02rvfmp','Everyone I Have Ever Slept With 1963–1995, also known as \"The Tent\", was an artwork created by Tracey Emin RA, an English artist and a leading member of the group known as Britartists or YBAs. The work was a tent with the appliquéd names of, literally, everyone she had ever slept with, but not necessarily in the sexual sense. It achieved iconic status, was owned by Charles Saatchi, and was destroyed in the 2004 Momart London warehouse fire. She has refused to recreate it.'),('/m/02ry5h1','The Madonna and Child with Six Saints, also known as Sant\'Ambrogio Altarpiece, is a painting by the Italian Renaissance master Sandro Botticelli, finished around 1470. It is housed in the Galleria degli Uffizi, in Florence.\nIt portrays the Virgin enthroned with the saints Mary Magdalene, John the Baptist, Francis, Catherine of Alexandria and, kneeling, Cosmas and Damian. It is in fact most likely that the latter are portraits of Medici members. Lorenzo il Magnifico and his brother Giuliano have been considered.'),('/m/02t1t','The Easter Rising, also known as the Easter Rebellion, was an armed insurrection staged in Ireland during Easter Week, 1916. The Rising was mounted by Irish republicans with the aims of ending British rule in Ireland, seceding from the United Kingdom of Great Britain and Ireland, and establishing an independent Irish Republic at a time when the United Kingdom was heavily engaged in World War I. It was the most significant uprising in Ireland since the rebellion of 1798.\nOrganised by seven members of the Military Council of the Irish Republican Brotherhood, the Rising began on Easter Monday, 24 April 1916, and lasted for six days. Members of the Irish Volunteers — led by schoolmaster and Irish language activist Patrick Pearse, joined by the smaller Irish Citizen Army of James Connolly, along with 200 members of Cumann na mBan — seized key locations in Dublin and proclaimed the Irish Republic independent of the United Kingdom. There were some actions in other parts of Ireland: however, except for the attack on the Royal Irish Constabulary barracks at Ashbourne, County Meath, they were minor.'),('/m/02w1tg1','Water Lilies is a series of approximately 250 oil paintings by French Impressionist Claude Monet. The paintings depict Monet\'s flower garden at Giverny and were the main focus of Monet\'s artistic production during the last thirty years of his life. Many of the works were painted while Monet suffered from cataracts.'),('/m/031l2h','The Exposition Universelle of 1889 was a World\'s Fair held in Paris, France from 6 May to 31 October 1889.\nIt was held during the year of the 100th anniversary of the storming of the Bastille, an event considered symbolic of the beginning of the French Revolution. The fair included a reconstruction of the Bastille and its surrounding neighborhood, but with the interior courtyard covered with a blue ceiling decorated with fleur-de-lys and used as a ball room and gathering place.\nThe 1889 Exposition covered a total area of 0.96 km², including the Champ de Mars, the Trocadéro, the quai d\'Orsay, a part of the Seine and the Invalides esplanade. Transport around the Exposition was partly provided by a 3 kilometre 600 millimetre gauge railway by Decauville. It was claimed that the railway carried 6,342,446 visitors in just six months of operation. Some of the locomotives used on this line later saw service on the Chemins de Fer du Calvados.'),('/m/0345gh','Birkbeck, University of London, is a public research university located in London, in the United Kingdom, which specialises in evening higher education, and a constituent college of the federal University of London.\nIt offers many Master\'s and Bachelor\'s degree programmes that can be studied either part-time or full-time, though nearly all teaching is in the evening. It also admits full-time students for PhDs. Its staff members have excellent research reputations in subjects such as English, Economics, Statistics, History, History of Art, Philosophy, Psychology, Spanish and Science. It also offers many continuing education courses leading to certificates and diplomas, foundation degrees as well as other short courses.\nBirkbeck counts four Nobel prize winners and a British Prime Minister among its former students and staff.'),('/m/03c1v5x','A Tale of the House of the Wolfings and All the Kindreds of the Mark is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first published in hardcover by Reeves and Turner in 1889. Its importance in the history of fantasy literature was recognized by its republication by the Newcastle Publishing Company as the sixteenth volume of the celebrated Newcastle Forgotten Fantasy Library in April, 1978.\nThis book also influenced J. R. R. Tolkien\'s popular The Lord of the Rings. In a December 31, 1960 letter published in The Letters of J. R. R. Tolkien, Tolkien wrote: \'The Dead Marshes and the approaches to the Morannon owe something to Northern France after the Battle of the Somme. They owe more to William Morris and his Huns and Romans, as in The House of the Wolfings or The Roots of the Mountains.\" Among the numerous parallels with The Lord of the Rings, Morris has Old English-style placenames such as Mirkwood, germanic personal names such as Thiodolf, and dwarves as skilled smiths.'),('/m/03c2sfs','Child Christopher and Goldilind the Fair is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first published in hardcover by Morris\' Kelmscott Press in 1895. Its importance in the history of fantasy literature was recognized by its republication by the Newcastle Publishing Company as the twelfth volume of the celebrated Newcastle Forgotten Fantasy Library in April, 1977.'),('/m/03c888j','Mary Magdalene is a Pre-Raphaelite painting by Frederick Sandys. Mary Magdalene was the only character from the Bible that Sandys ever painted. Having sharp features reminiscent of Lizzie Siddal, Mary is depicted in front of a patterned forest-green damask. She holds an alabaster ointment cup, a traditional attribute which associates her with the anonymous sinful woman who anointed Jesus\' feet in Luke 7:37. Like other Pre-Raphaelite painters, Frederick Sandys gave Magdalene a sensual look.\nDante Rossetti accused Sandys of plagiarism, because of the resemblance to his Mary Magdalene Leaving the House of Feasting, but when Rossetti came to paint Magdalene some twenty years later, it was his painting that resembled Sandys. Mary Magdalene was acquired in 1894 by Samuel Bancroft Jr., the most important American collector of Pre-Raphaelite art, whose family donated his collection to the Delaware Art Museum in 1935. Bancroft bought it from Charles Fairfax Murray, an artist in the Pre-Raphaelite circle.\nIt has been exhibited, as part of a touring exhibition of the Bancroft Collection, at the Saint Louis Art Museum, San Diego Museum of Art, the Frick Art & Historical Center, Pittsburgh, Nottingham Castle and other locations. It was once featured in an oversize advertisement in the San Antonio International Airport.'),('/m/03cbyg3','The Lady of Shalott is an 1888 oil-on-canvas painting by the English Pre-Raphaelite painter John William Waterhouse in Tate Britain in London, where it is usually on display, in room 1840 in 2013. The work is a representation of a scene from Alfred, Lord Tennyson\'s 1832 poem of the same name, in which the poet describes the plight of a young woman, loosely based on the figure of Elaine of Astolat from medieval Arthurian legend, who yearned with an unrequited love for the knight Sir Lancelot, isolated under an undisclosed curse in a tower near King Arthur\'s Camelot. Tennyson also reworked the story in Elaine, part of his Arthurian epic Idylls of the King, published in 1859, though in this version the Lady is rowed by a retainer in her final voyage. Waterhouse painted three different versions of this character, in 1888, 1894 and 1915.\nAccording to Tennyson\'s version of the legend, the Lady of Shalott was forbidden to look directly at reality or the outside world; instead she was doomed to view the world through a mirror, and weave what she saw into tapestry.'),('/m/03cch4g','A Dream of John Ball is a novel by English author William Morris about the English peasants\' revolt of 1381. It features the rebel priest John Ball, who appeared to be advocating a socialistic philosophy in advance of his time. John Ball is famed for his question \"When Adam delved and Eve span, who was then the gentleman?\"'),('/m/03chbfl','Campbell\'s Soup Cans II is a work of art produced in 1969 by Andy Warhol as part of his Campbell\'s Soup Cans series. 250 sets of this print were made, and edition #17 is in the collection at the Museum of Contemporary Art, Chicago. It consists of ten prints:\nTomato Beef Noodle O\'\nChicken \'n Dumplings\nVegetarian Vegetable\nClam Chowder\nOld fashioned vegetable made with beef stock\nScotch Broth\nCheddar Cheese\nOyster Stew\nGolden Mushroom\nHot Dog Bean'),('/m/03cy_37','The Madonna della Loggia is a painting attributed to the Italian Renaissance artist Sandro Botticelli, dating to c. 1467. A tempera on panel work, it is located in the Uffizi, Florence, Italy.'),('/m/03l_8xl','Whaam! is a 1963 diptych painting by the American artist Roy Lichtenstein. It is one of the best-known works of pop art, and among Lichtenstein\'s most important paintings. Whaam! was first exhibited at the Leo Castelli Gallery in New York City in 1963, and purchased by the Tate Gallery, London, in 1966. It has been on permanent display at Tate Modern since 2006.\nThe left-hand panel shows a fighter plane firing a rocket that, in the right-hand panel, hits a second plane which explodes in flames. Lichtenstein conceived the image from several comic-book panels. He transformed his primary source, a panel from a 1962 war comic book, by presenting it as a diptych while altering the relationship of the graphical and narrative elements. Whaam! is regarded for the temporal, spatial and psychological integration of its panels. The painting\'s title is integral to the action and impact of the painting, and displayed in large onomatopoeia in the right panel.\nLichtenstein studied as an artist before and after serving in the United States Army during World War II.'),('/m/03mb7l4','Helen of Troy is an 1898 painting by Evelyn De Morgan depicting Helen of Troy; it was commissioned by William Imrie of Liverpool.\nCompositionally, the painting is similar to De Morgan\'s Flora and Cassandra: Helena is standing upright and tall, in a peaceful posture that reminds to Boticcelli\'s representations of Greek and Roman goddesses that are, at the same time, an evocation of classical art, a usual characteristic between Renaissance artists. Helena has been removed from the common artistic elements of the Trojan War: despite dealing with a typically bellic topic, De Morgan decides to paint, instead of weapons and battles, the wonderful pink clothes and the fascinated look that Helena puts on the mirror that is reflecting her beautiful face, elements that can be read as symbols of her inconscient vanity, which eventually brought a long and terrible war and destruction to the city of Troy, which we can see in the last term of the composition, on top of a hill. The presence of the moon-sun in the sky is also related to her feminine and voluble nature.'),('/m/03mdtvg','Beata Beatrix is an oil on canvas painting by Pre-Raphaelite artist Dante Gabriel Rossetti, completed in 1870. It depicts Beatrice Portinari from Dante Alighieri\'s poem La Vita Nuova at the moment of her death. The painting\'s title in English translates to \'Blessed Beatrice\'. La Vita Nuova had been a story that Rossetti had found of interest from childhood and he had begun work translating it into English in 1845 and published it in his work, The Early Italian Poets.\nRossetti modeled Beatrice after his deceased wife and frequent model, Elizabeth Siddal, who died in 1862. The painting was created from the numerous drawings that Rossetti had made of Siddal during their time together. The symbolism in the painting of a red dove, a messenger of love, relates back to Rossetti\'s love for Siddal with the white poppy representing laudanum and the means of her death. Several of Siddal\'s friends found the painting to bear little resemblance to the drawings of her—the facial features were harder and the neck is out of proportion. Beata Beatrix is one of Rossetti\'s most recognized works and has made Siddal\'s name to be one that is frequently linked with Dante Alighieri\'s Beatrice.\nIn an 1873 letter to his friend William Morris, Rossetti said he intended the painting \"not as a representation of the incident of the death of Beatrice, but as an ideal of the subject, symbolized by a trance or sudden spiritual transfiguration.\"'),('/m/03nxm6j','The Resurrection of Christ, also called The Kinnaird Resurrection, is an oil painting on wood by the Italian High Renaissance master Raphael. The work is one the earliest known paintings by the artist, executed between 1499 and 1502. It is probably a piece of an unknown predella, though it has been suggested that the painting could be one of the remaining works of the Baronci altarpiece, Raphael\'s first recorded commission. The painting is housed in the São Paulo Museum of Art.\nThe Kinnaird Resurrection is one of the first preserved works of Raphael in which his natural dramatic style of composition was already obvious, as opposed to the gentle poetic style of his master, Pietro Perugino. The extremely rational composition is ruled by a complex ideal geometry which interlinks all the elements of the scene and gives it a strange animated rhythm, transforming the characters in the painting into co-protagonists in a unique \"choreography\". The painting possesses an esthetic influence from Pinturicchio and Melozzo da Forlì, though the spatial orchestration of the work, with its tendency to movement, shows Raphael\'s knowledge of the Florentine artistic milieu of the 16th century.'),('/m/03q9yqz','Waterloo Bridge, Sunlight Effect (1903) is a painting by French artist Claude Monet.'),('/m/03q9zyt','\"Water Lily Pond\" (c. 1917-1922) is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/03q9_20','Charing Cross Bridge, London is a 1901 painting by French impressionist Claude Monet.'),('/m/03qb2mw','Arrival of the Normandy Train, Gare Saint-Lazare (1877) is an oil on canvas painting by French artist Claude Monet.'),('/m/03qb58l','Poppy Field (Giverny) is a painting by French Impressionist painter Claude Monet. It was begun in 1890 while Monet and his family were renting property near Giverny, France. During the nearly forty years that Monet took up residence near Giverny he created several notable works of art.'),('/m/03qb6xk','Houses of Parliament, London (1900-1901) is a painting by French artist Claude Monet.'),('/m/03qb7t1','The Artist\'s House at Argenteuil (1873) is a painting by French artist Claude Monet.'),('/m/03qhzsc','The Madonna Colonna is a painting by the Italian Renaissance artist Raphael. It was painted in 1508, near the end of Raphael\'s Florentine period.'),('/m/03qqzvj','Drowning Girl is a 1963 painting with oil and synthetic polymer paint on canvas by Roy Lichtenstein. Utilizing the conventions of comic book art, a thought bubble conveys the thoughts of the figure, while Ben-Day dots echo the effect of the mechanized printing process. It is one of the most representative paintings of the pop art movement, and part of the Museum of Modern Art\'s permanent collection since 1971. The painting is considered among Lichtenstein\'s most significant works, perhaps on a par with his acclaimed 1963 diptych Whaam!. Drowning Girl has been described as a \"masterpiece of melodrama\", and is one of the artist\'s earliest images depicting women in tragic situations, a theme to which he often returned in the mid-1960s.\nThe painting shows a teary-eyed woman on a turbulent sea. She is emotionally fraught, seemingly from a romance. She declares that she would rather sink in the ocean than call Brad. This is revealed through a thought bubble that provides the narrative element: \"I Don\'t Care! I\'d Rather Sink — Than Call Brad For Help!\" The narrative element highlights the cliched melodrama, while its graphics reiterate Lichtenstein\'s theme of painterly work depicting mechanized reproduction. The work is derived from a 1962 DC Comics panel, while also borrowing from Hokusai\'s The Great Wave off Kanagawa and from elements of modernist artists Jean Arp and Joan Miró. It is one of several Lichtenstein works that mentions a hero named Brad who is absent from the picture. Both the graphical and narrative elements of the work are significantly cropped from the original source image.'),('/m/03qr08b','Girl with Ball is a 1961 painting by Roy Lichtenstein. It is an oil on canvas Pop art work that is now in the collection of the Museum of Modern Art, after being owned for several decades by Philip Johnson. It is one of Lichtenstein\'s earliest Pop art works and is known for its source, which is a newspaper ad that ran for several decades and which was among Lichtenstein\'s earliest works sourced from pop culture.\nGirl with Ball was exhibited at Lichtenstein\'s first solo exhibition and was displayed in Newsweek\'s review of the show. This work significantly alters the original source and is considered exemplary of Lichtenstein\'s works that exaggerate the mechanically-produced appearance although the result of his painterly work. It is an enduring depiction of the contemporary beauty figure.'),('/m/03sd00','Giverny is a commune in the Eure department in northern France. It is best known as the location of Claude Monet\'s garden and home.'),('/m/03v9b1','Solomon \"Sol\" LeWitt was an American artist linked to various movements, including Conceptual art and Minimalism.\nLeWitt came to fame in the late 1960s with his wall drawings and \"structures\" but was prolific in a wide range of media including drawing, printmaking, photography, and painting. He has been the subject of hundreds of solo exhibitions in museums and galleries around the world since 1965.'),('/m/03vl8','The Industrial Revolution was the transition to new manufacturing processes in the period from about 1760 to sometime between 1820 and 1840. This transition included going from hand production methods to machines, new chemical manufacturing and iron production processes, improved efficiency of water power, the increasing use of steam power, and the development of machine tools. It also included the change from wood and other bio-fuels to coal.\nTextiles were the dominant industry of the Industrial Revolution in terms of employment, value of output and capital invested. Textiles were also the first to use modern production methods.\nThe Industrial Revolution marks a major turning point in history; almost every aspect of daily life was influenced in some way. In particular, average income and population began to exhibit unprecedented sustained growth. Some economists, such as Robert E. Lucas, Jr., argue that the real impact of the Industrial Revolution was that \"for the first time in history, the living standards of the masses of ordinary people have begun to undergo sustained growth ...'),('/m/03xpqgs','Dante Gabriel Rossetti was an English poet, illustrator, painter and translator. He founded the Pre-Raphaelite Brotherhood in 1848 with William Holman Hunt and John Everett Millais, and was later to be the main inspiration for a second generation of artists and writers influenced by the movement, most notably William Morris and Edward Burne-Jones. His work also influenced the European Symbolists and was a major precursor of the Aesthetic movement.\nRossetti\'s art was characterised by its sensuality and its medieval revivalism. His early poetry was influenced by John Keats. His later poetry was characterised by the complex interlinking of thought and feeling, especially in his sonnet sequence The House of Life. Poetry and image are closely entwined in Rossetti\'s work; he frequently wrote sonnets to accompany his pictures, spanning from The Girlhood of Mary Virgin and Astarte Syriaca, while also creating art to illustrate poems such as Goblin Market by the celebrated poet Christina Rossetti, his sister.\nRossetti\'s personal life was closely linked to his work, especially his relationships with his models and muses Elizabeth Siddal, Fanny Cornforth, and Jane Morris.'),('/m/04044wt','The Boyhood of Raleigh is a painting by John Everett Millais, which was exhibited at the Royal Academy in 1871. It came to epitomise the culture of heroic imperialism in late Victorian Britain and in British popular culture up to the mid-twentieth century.\nThe painting depicts the young, wide-eyed Sir Walter Raleigh and his brother sitting on the beach by the Devonshire coast. He is listening to a story of life on the seas, told by an experienced sailor who points out to the sea.'),('/m/041h0','John Ronald Reuel Tolkien, CBE was an English writer, poet, philologist, and university professor, best known as the author of the classic high fantasy works The Hobbit, The Lord of the Rings, and The Silmarillion.\nHe served as the Rawlinson and Bosworth Professor of Anglo-Saxon and Fellow of Pembroke College, Oxford, from 1925 to 1945 and Merton Professor of English Language and Literature and Fellow of Merton College, Oxford from 1945 to 1959. He was at one time a close friend of C. S. Lewis—they were both members of the informal literary discussion group known as the Inklings. Tolkien was appointed a Commander of the Order of the British Empire by Queen Elizabeth II on 28 March 1972.\nAfter Tolkien\'s death, his son Christopher published a series of works based on his father\'s extensive notes and unpublished manuscripts, including The Silmarillion. These, together with The Hobbit and The Lord of the Rings form a connected body of tales, poems, fictional histories, invented languages, and literary essays about a fantasy world called Arda, and Middle-earth within it. Between 1951 and 1955, Tolkien applied the term legendarium to the larger part of these writings.'),('/m/044lz','John Philippe Rushton was a British-born Canadian psychology professor at the University of Western Ontario who became known to the general public during the 1980s and 1990s for research on race and intelligence, race and crime, and other apparent racial variation. His book Race, Evolution and Behavior is about the application of r/K selection theory to humans.\nRushton\'s controversial work came under attack within the scientific community for the quality of the research, and allegations that it was racist. From 2002 he was head of the Pioneer Fund, a research foundation accused of being racist.\nRushton was a Fellow of the American, British, and Canadian Psychological Associations and onetime Fellow of the John Simon Guggenheim Memorial Foundation.'),('/m/0455rvq','\"The Wheel of Fortune\" (1883) is a painting by British artist Edward Burne-Jones.'),('/m/0455rvx','King Cophetua and the Beggar Maid is an 1884 painting by the Pre-Raphaelite artist Edward Burne-Jones. The painting illustrates the story of \'The King and the Beggar-maid\", which tells the legend of the prince Cophetua and his love for the beggar Penelophon. The tale was familiar to Burne-Jones through an Elizabethan ballad published in Bishop Thomas Percy\'s 1765 Reliques of Ancient English Poetry and the sixteen-line poem The Beggar Maid by Alfred, Lord Tennyson.\nBurne-Jones first attempted the story in an oil painting of 1861–62. He was working out a new composition around 1874 or 1875, and began the painting in earnest in 1881. He worked on it through the winter of 1883-84, declaring it finished in April 1884.\nThe composition is influenced by Andrea Mantegna\'s Madonna della Vittoria. Several studies for the final work survive. A small gouache of c. 1883 shows the king and the beggar maid much closer together, and a full-scale cartoon in bodycolour and coloured chalks of the same year features an entirely different approach to lighting the figures.'),('/m/0455sxt','\"Princess Sabra\" (1865) is a painting by British artist Edward Burne-Jones.'),('/m/0457wck','The Golden Stairs is one of the best-known paintings by the Pre-Raphaelite artist Edward Burne-Jones. It was begun in 1876 and exhibited at the Grosvenor Gallery in 1880.\nUnlike many of Burne-Jones\'s works, The Golden Stairs is not based on a literary source. It has been called Symbolist, as it has no recognisable narrative, but rather sets a mood. It is a harmony of color in the tradition of the Aesthetic works of the 1860s and 1870s, as a group of young women carrying musical instruments descend a spiraling staircase, dressed in classically inspired robes in tones of white, shading to gold and silver. Critic F. G. Stephens wrote in the Athenaeum that the musicians \"troop past like spirits in an enchanted dream ... whither they go, who they are, there is nothing to tell\".\nThe Golden Stairs was one of many paintings Burne-Jones sketched out in 1872 following a trip to Italy. He began work on the canvas in 1876 and finished it in great haste in April 1880, just days before the Grosvenor Gallery exhibition was to open. Stephens found in the painting echoes of the work of Piero della Francesca, whose frescoes Burne-Jones had seen and copied in 1871.'),('/m/0457wz7','\"Chant d\'Amour\" (The Love Song) (c. 1868-1873) is a painting by British artist Edward Burne-Jones.'),('/m/045blt0','\"Les Dindons\" (1877) is a painting by French Impressionist artist Claude Monet.'),('/m/047lvl3','The Battle of Lincoln, New Mexico was a five-day long firefight which took place from July 15-19, 1878. The largest armed battle of the Lincoln County War, it was the climax of that conflict, taking place in America\'s Old West at Lincoln, New Mexico.'),('/m/047s70s','The Siren is a painting by John William Waterhouse. The painting depicts a siren sitting at the edge of a cliff, lyre in hand and staring down at a shipwrecked sailor floating in water, who in turn is staring up at her.\nAccording to the William Waterhouse\'s website, this picture was painted in 1900 and is now in a private collection. The estimated sale price for the painting in 2003 was one million pounds.\n\"The Siren He listened in thrall to the song of the siren, Her voice like a star as it flew through the air. He drowned in her eyes as she called him to follow, And likened the sun to the gold of her hair.\nShe swept up her arms and held him close to her, Her soft lips caressing the lines on his brow. He could not resist her, a magic had trapped him, And nothing could save him, for she had him now.\nShe pulled him down with her into the clear water, He gasped as death started the grip on his soul. His life ebbed away as she dragged him still further, And laughed when she saw she\'d accomplished her goal.\" - Charlotte Lester.'),('/m/04b0cm','News from Nowhere is a classic work combining utopian socialism and soft science fiction written by the artist, designer and socialist pioneer William Morris. In the book, the narrator, William Guest, falls asleep after returning from a meeting of the Socialist League and awakes to find himself in a future society based on common ownership and democratic control of the means of production. In this society there is no private property, no big cities, no authority, no monetary system, no divorce, no courts, no prisons, and no class systems. This agrarian society functions simply because the people find pleasure in nature, and therefore they find pleasure in their work.\nThe book explores a number of aspects of this society, including its organisation and the relationships which it engenders between people. Morris cleverly fuses Marxism and the romance tradition when he presents himself as an enchanted figure in a time and place different from Victorian England. As Morris, the romance character, quests for love and fellowship—and through them for a reborn self—he encounters romance archetypes in Marxist guises. Old Hammond is both the communist educator who teaches Morris the new world and the wise old man of romance. Dick and Clara are good comrades and the married lovers who aid Morris in his wanderings. The journey on the Thames is both a voyage through society transformed by revolution and a quest for happiness. The goal of the quest, met and found though only transiently, is Ellen, the symbol of the reborn age and the bride the alien cannot win. Ellen herself is a multidimensional figure; a working class woman emancipated under socialism, she is also a benign nature spirit as well as the soul in the form of a woman. The book offers Morris\' answers to a number of frequent objections to socialism, and underlines his belief that socialism will entail not only the abolishment of private property but also of the divisions between art, life, and work.'),('/m/04d11nr','This was a retrospective of the Turner Prize, featuring all the winning works from 1984-2006.'),('/m/04f44c3','Ann Dancing is an artwork created in 2007 by Julian Opie a Welsh artist and former trustee of the Tate. The sculpture was removed from its base on August 20, 2008, for repairs, and was returned on October 31 of that year.'),('/m/04g21fg','At Binsey, near Oxford is a watercolour painting by the English Victorian artist George Price Boyce, who was associated with the Pre-Raphaelite art movement.\nThis 1862 watercolour is a view in the village of Binsey close to the city of Oxford in Oxfordshire, England.'),('/m/04gdb79','\"Ophelia\" (c. 1865) is a painting by Arthur Hughes, based on the character of the same name from Shakespeare\'s play \"Hamlet\".'),('/m/04lk5vt','The exhibition is comprised of a stunning selection of paintings that span the entirety of OKeeffes career from 1918 to 1977.'),('/m/04lmk0n','This exhibition brings together the work of 24 photographers and represents a broad social commentary on the United States at this pivotal moment in the country\'s history.'),('/m/04mzzt','Freeze is the title of an art exhibition that took place in July 1988 in an empty London Port Authority building at Surrey Docks in London Docklands. Its main organiser was Damien Hirst. It was significant in the subsequent development of the Young British Artists.'),('/m/04pfks','The Sara Lee Corporation was an American consumer-goods company based in Downers Grove, Illinois. It had operations in more than 40 countries and sold its products in over 180 nations worldwide. Its international operations were headquartered in Utrecht, The Netherlands.\nSara Lee is also the brand name of a number of frozen and packaged foods, often known for the long-running slogan \"Everybody doesn\'t like something, but nobody doesn\'t like Sara Lee,\" often incorrectly reported as \"Nobody does it like Sara Lee.\"\nWhile the company traced its lineage to 1939, when Nathan Cummings acquired C. D. Kenny Company, a wholesale distributor of sugar, coffee, and tea in Baltimore, the Sara Lee Corporation was actually the descendant of a Chicago grocery store called Sprague, Warner & Company. This enterprise, which started on State Street in Chicago, was founded during the Civil War by Albert A. Sprague and Ezra J. Warner. By 1909, Sprague, Warner & Company was one of the leading wholesale grocery companies in the United States, famous for house brands such as Richelieu, Ferndell, and Batavia. In 1942, this company was acquired by the Canadian-born Cummings.'),('/m/04q94cc','A Converted British Family Sheltering a Christian Missionary from the Persecution of the Druids is a painting by William Holman Hunt that was exhibited at the Royal Academy in 1850, and is now in the Ashmolean Museum in Oxford. It was a companion to John Everett Millais\'s Christ in the House of His Parents. Both artists sought to depict similar episodes from very early Christian history, portraying families helping an injured individual. Both stressed the primitivism of the scene.'),('/m/04r12z','The Irish Museum of Modern Art also known as IMMA, is Ireland\'s leading national institution for the collection and presentation of modern and contemporary art. Located in Dublin, the Museum presents a wide variety of art in a changing programme of exhibitions, which regularly includes bodies of work from its own collection and its education and community department. It also aims to create more widespread access to art and artists through its studio and national programmes.\nThe Museum’s mission is to foster within society an awareness, understanding and involvement in the visual arts through policies and programmes which are excellent, innovative and inclusive.'),('/m/04vw0j3','\"The Annunciation\" (1879) is a painting by British artist Edward Burne-Jones.'),('/m/04vw0j9','\"The Mill\" (1892) is a painting by British artist Edward Burne-Jones.'),('/m/04xswj','Ophelia is a painting by British artist Sir John Everett Millais, completed between 1851 and 1852. Currently held in the Tate Britain in London, it depicts Ophelia, a character from Shakespeare\'s play Hamlet, singing before she drowns in a river in Denmark.\nThe work was not widely regarded when first exhibited at the Royal Academy, but has since come to be admired for its beauty and its accurate depiction of a natural landscape. Ophelia has been estimated to have a market value of over £30 million.'),('/m/04y9zg6','The Great Sioux War of 1876, also known as the Black Hills War, was a series of battles and negotiations which occurred between 1876 and 1877 involving the Lakota Sioux and Northern Cheyenne against the United States. As gold was discovered in the Black Hills, settlers began to encroach onto Indian lands, while pressure was mounted by the federal government for the Indians to remain on the Sioux reservation. Traditionally, the United States military and historians place the Lakota at the center of the story, especially given their numbers, but some American Indians believe the Cheyenne were the primary target of the US campaign. An alternative interpretation suggests that the Indians would have called it \"The Great Cheyenne War\".\nAmong the many battles and skirmishes of the war was the Battle of the Little Bighorn, often known as Custer\'s Last Stand, the most storied of the many encounters between the U.S. army and mounted Plains Indians. That Indian victory notwithstanding, the U.S. with its superior resources was soon able to force the Indians to surrender, primarily by attacking and destroying their encampments and property.'),('/m/04yg5v9','The Awakening Conscience is an oil-on-canvas painting by English artist William Holman Hunt, one of the founders of the Pre-Raphaelite Brotherhood, which depicts a young woman rising from her position in the lap of a man and gazing transfixed out of the window of a room.\nInitially the painting would appear to be one of a momentary disagreement between husband and wife, or brother and sister, but the title and a host of symbols within the painting make it clear that this is a mistress and her lover. The woman\'s clasped hands provide a focal point and the position of her left hand emphasizes the absence of a wedding ring. Around the room are dotted reminders of her \"kept\" status and her wasted life: the cat beneath the table toying with a bird; the clock concealed under glass; a tapestry which hangs unfinished on the piano; the threads which lie unravelled on the floor; the print of Frank Stone\'s Cross Purposes on the wall; Edward Lear\'s musical arrangement of Tennyson\'s poem \"Tears, Idle Tears\" which lies discarded on the floor, and the music on the piano, Thomas Moore\'s \"Oft in the Stilly Night\", the words of which speak of missed opportunities and sad memories of a happier past. The discarded glove and top hat thrown on the table top suggest a hurried assignation. The room is too cluttered and gaudy to be in a Victorian family home; the bright colours, unscuffed carpet, and pristine, highly-polished furniture speak of a room recently furnished for a mistress. Art historian Elizabeth Prettejohn notes that although the interior is now viewed as \"Victorian\" it still exudes the \"\'nouveau-riche\' vulgarity\" that would have made the setting distasteful to contemporary viewers. The painting\'s frame is decorated with further symbols: bells, marigolds, and a star above the girl\'s head. It also bears a verse from the Book of Proverbs: \"As he that taketh away a garment in cold weather, so is he that singeth songs to an heavy heart\".'),('/m/04yh7tr','An Oak Tree is a conceptual work of art created by Michael Craig-Martin in 1973. The piece, described as being an oak tree, is installed in two units - a pristine installation of a glass of water on a glass shelf on metal brackets 253 centimetres above the ground, and a text mounted on the wall. When first exhibited, the text was given as a handout.\nThe text takes the form of a Q&A about the artwork, in which Craig-Martin describes changing \"a glass of water into a full-grown oak tree without altering the accidents of the glass of water,\" and explains that \"the actual oak tree is physically present but in the form of the glass of water.\" Craig-Martin considered \"the work of art in such a way as to reveal its single basic and essential element, belief that is the confident faith of the artist in his capacity to speak and the willing faith of the viewer in accepting what he has to say\".\nThe work makes the same claim as the Roman Catholic doctrine of Transubstantiation and the Real Presence.\nThe original is in the National Gallery of Australia and an artist\'s copy is on loan to the Tate gallery.'),('/m/04zw58','Samantha \"Sam\" Taylor-Johnson OBE, known professionally as Sam Taylor-Wood, is an English filmmaker, photographer and visual artist. Her directorial feature film debut came in 2009 with Nowhere Boy, a film based on the childhood experiences of the Beatles songwriter and singer John Lennon. She is one of a group of artists known as the Young British Artists. She is married to English actor Aaron Taylor-Johnson.'),('/m/050_704','Mother and Child, Divided is a 1995 Turner Prize Award winning work by Damien Hirst.'),('/m/0514lqw','\"The Arming of Perseus\" (1885) is a painting by British artist Edward Burne-Jones.'),('/m/0514lrf','\"Phyllis and Demophoon\" (1870) is a painting by British artist Edward Burne-Jones.'),('/m/0514lzx','Lady Lilith is an oil painting by Dante Gabriel Rossetti first painted in 1866–68 using his mistress Fanny Cornforth as the model, then altered in 1872–73 to show the face of Alexa Wilding. The subject is Lilith, who was, according to ancient Judaic myth, \"the first wife of Adam\" and is associated with the seduction of men and the murder of children. She is shown as a \"powerful and evil temptress\" and as \"an iconic, Amazon-like female with long, flowing hair.\"\nRossetti overpainted Cornforth\'s face, perhaps at the suggestion of his client, shipping magnate Frederick Richards Leyland, who displayed the painting in his drawing room with five other Rossetti \"stunners.\" After Leyland\'s death, the painting was purchased by Samuel Bancroft and Bancroft\'s estate donated it in 1935 to the Delaware Art Museum where it is now displayed.\nThe painting forms a pair with Sibylla Palmifera, painted 1866–70, also with Wilding as the model. Lady Lilith represents the body\'s beauty, according to Rossetti\'s sonnet inscribed on the frame. Sibylla Palmifera represents the soul\'s beauty, according to the Rossetti sonnet on its frame.'),('/m/0514l_2','Proserpine is an oil painting on canvas by English artist and poet Dante Gabriel Rossetti, painted in 1874 and currently housed at Tate Britain.'),('/m/0514l_8','The Beloved is an oil painting on canvas by English artist Dante Gabriel Rossetti, first painted in 1865 and currently housed at Tate Britain.'),('/m/0514l_g','Pia de\' Tolomei is an oil painting on canvas by English artist Dante Gabriel Rossetti, painted around 1868 and currently housed at the Spencer Museum of Art, on the campus of the University of Kansas in Lawrence, Kansas.'),('/m/0514l_n','Joan of Arc (1864) is a painting by British artist Dante Gabriel Rossetti.'),('/m/0514m00','Dante\'s Dream is a painting from 1871 by the English Pre-Raphaelite painter Dante Gabriel Rossetti. It hangs in the Walker Art Gallery, Liverpool, Merseyside, England.\nRossetti had a lifelong interest in the Italian poet Dante Alighieri. The painting was inspired by Dante\'s poem La Vita Nuova. In this poem Dante dreams that he is led to the death-bed of Beatrice Portinari, who was the object of his unfulfilled love. Dante, in black, stands looking towards the dying Beatrice who is lying on a bed. Two female figures in green hold a canopy over her. An angel in red holds Dante\'s hand and leans forward to kiss Beatrice.\nIn the painting, Rossetti creates a visionary world with complex symbols. The symbols include the green clothes of Beatrice\'s attendants, signifying hope; spring flowers in the foreground symbolising purity; and red doves for love.\nIt is Rossetti\'s largest painting. The model for Beatrice was Jane Morris, the wife of William Morris. The Walker Art Gallery bought the painting directly from the artist in 1881 for £1575. In 1897 it was sent to Berlin to be photographed, but was then noted to be \"in a dirty condition\". Again in 1904 the painting was noted to be in \"a bad condition\" and it was considered that its condition had been worsened by its journey to and from Berlin. The painting was sent in 1908 to the National Gallery in London to be relined, that is, for a new canvas to the glued to the original. It was then returned to Liverpool. During the Second World War, it was removed from its stretcher, rolled and stored in the basement of the gallery. In 1941 the painting was moved, together with other large paintings from the gallery, to Ellesmere College in Shropshire. It was noted at this time that it had sustained some damage. Conservation work was carried out on the painting in 1960 and in 1985.'),('/m/0514m06','Ecce Ancilla Domini, or The Annunciation, is an oil painting by the English artist Dante Gabriel Rossetti, first painted in 1850 and now in Tate Britain in London. The Latin title is a quotation from the Vulgate text of the first chapter of the Gospel of Saint Luke, describing the Annunciation, where Mary accepts the message brought to her by the Angel Gabriel that she would give birth to a child by God.'),('/m/0522mf1','Ajmal Masroor is a Bangladeshi-born British Imam, broadcaster and politician. He is well known for being a television presenter on political discussions and on Muslim channels.'),('/m/0524r_h','The Last Sleep of Arthur in Avalon is a painting by Edward Burne-Jones, started in 1881. The massive painting measures 279 cm × 650 cm, and is widely considered to be Burne-Jones\'s magnum opus.\nThe painting was originally commissioned from Burne-Jones by his patron George Howard, 9th Earl of Carlisle, to hang on a wall in the library of Naworth Castle. Howard shared Burne-Jones\'s affection for the Arthurian legend and left the choice of topic to the artist. Burne-Jones started working on it in 1881 and continued for 17 years. Within this period, he also designed the stage set for the play King Arthur by J. Comyns Carr that premiered in London in January 1895.\nThe 1880s brought the deaths of Burne-Jones\'s close friends. As they died, the artist experienced mounting isolation and painful awareness of his own mortality. Immersed in his work, Burne-Jones identified himself with Arthur and even adopted Arthur\'s pose when he himself slept. By 1885, the association with Arthur reached the point where Burne-Jones had to ask Howard to cancel or revise his original commission, replacing the grand scene with a smaller painting focused on the departed king. Howard agreed to cancellation and never requested his downpayment back. Nevertheless, Burne-Jones returned to the original grand painting, and worked on it for the remaining thirteen years of his life. Arthur became increasingly autobiographical for the artist as he withdrew into himself; \"above all the picture is about silence.\"'),('/m/052j3sb','\"The Two Princes Edward and Richard in the Tower\" (1878) is a painting by Sir John Everett Millais. The painting is part of the Royal Holloway picture collection today.The painting depicts Edward V of England (November 4, 1470  1483?) and his brother, Richard of Shrewsbury, 1st Duke of York (17 August 1473  1483?), two sons of Edward IV of England and Elizabeth Woodville. Both princes were  declared illegitimate by an Act of Parliament of 1483 known as Titulus Regius. Their uncle, who would become Richard III of England, placed them in the Tower of London in 1483, where the boys may have died or been killed later that year.'),('/m/053_g0','The Sioux Wars were a series of conflicts between the United States and various subgroups of the Sioux people that occurred in the later half of the 19th century. The earliest conflict came in 1854 when a fight broke out at Fort Laramie in Wyoming, when Sioux warriors killed several American soldiers in the Grattan Massacre, and the final came in 1890 during the Ghost Dance War.'),('/m/055rd2','Michael Craig-Martin, RA is a contemporary conceptual artist and painter. He is noted for his fostering of the Young British Artists, many of whom he taught, and for his conceptual artwork, An Oak Tree. He is Emeritus Professor of Fine Art at Goldsmiths.'),('/m/057vlkc','Portrait of a Young Man or Portrait of a Youth, a portrait attributed to Sandro Botticelli, is an example of Italian Renaissance painting. It was painted in the early 1480s with tempera on panel and is now housed in the National Gallery of Art in Washington, D.C. Features of this piece include his interesting expression and elegant hand gesture, which some have interpreted as an early depiction of juvenile arthritis or Marfan syndrome.'),('/m/0598g7f','\"The Green Wave\" (1867) is a painting by Claude Monet.\nThe handling of paint and composition, especially the high horizon line, in this early seascape by Monet are clearly indebted to Manet\'s two depictions of American warships, \"The \'Kearsarge\' at Boulogne\" (at right) and \"The Battle of the \'Kearsarge\' and the \'Alabama\'\" (Philadelphia Museum of Art), which were exhibited in Paris in 1865 and 1867. Monet later added the date 1865, which is incorrect, as he visited the Normandy coast in 1866 and again in 1867.'),('/m/059rby','New York is a state in the Northeastern and Mid-Atlantic regions of the United States. New York is the 27th-most extensive, the third-most populous, and the seventh-most densely populated of the 50 United States. New York is bordered by New Jersey and Pennsylvania to the south and by Connecticut, Massachusetts, and Vermont to the east. The state has a maritime border with Rhode Island east of Long Island, as well as an international border with the Canadian provinces of Ontario to the west and north, and Quebec to the north. The state of New York is often referred to as New York State, so as to distinguish it from New York City.\nNew York City, with a Census-estimated population of over 8.4 million in 2013, is the most populous city in the United States. Alone, it makes up over 40 percent of the population of New York State. It is known for its status as a center for finance and culture and for its status as the largest gateway for immigration to the United States. New York City attracts considerably more foreign visitors than any other US city. Both the state and city were named for the 17th century Duke of York, future King James II of England.'),('/m/05b7z9h','\"Water Lilies and Japanese Bridge\" is a painting by Claude Monet.'),('/m/05b8446','\"Rouen Cathedral, West Facade, Sunlight\" (1894) is a painting by French artist Claude Monet.'),('/m/05bt973','Look Mickey is a 1961 oil on canvas painting by Roy Lichtenstein. Widely regarded as the bridge between his abstract expressionism and pop art works, it is notable for its ironic humor and aesthetic value as well as being the first example of the artist\'s employment of Ben-Day dots, speech balloons and comic imagery as a source for a painting. The painting was bequeathed to the Washington, D.C., National Gallery of Art upon Lichtenstein\'s death.\nBuilding on his late 1950s drawings of comic strips characters, Look Mickey marks Lichtenstein\'s first full employment of painterly techniques to reproduce almost faithful representations of pop culture and so satirize and comment upon the then developing process of mass production of visual imagery. In this, Lichtenstein pioneered a motif that became influential not only in 1960s pop art but continuing to the work of artists today. Lichtenstein borrows from a Donald Duck illustrated story book, showing Mickey Mouse and Donald Duck during a fishing mishap. However, he makes significant alterations to the original source, including modifying the color scheme and perspective, while seeming to make statements about himself.'),('/m/05c46q','Jane Morris was an English artists\' model who embodied the Pre-Raphaelite ideal of beauty. She was a model and muse to the artists William Morris, whom she married, and Dante Gabriel Rossetti.'),('/m/05c819','One and Three Chairs, 1965, is a work by Joseph Kosuth. An example of conceptual art, the piece consists of a chair, a photograph of this chair, and an enlarged dictionary definition of the word \"chair\". The photograph depicts the chair as it is actually installed in the room, and thus the work changes each time it is installed in a new venue.\nTwo elements of the work remain constant: a copy of a dictionary definition of the word \"chair\" and a diagram with instructions for installation. Both bear Kosuth\'s signature. Under the instructions, the installer is to choose a chair, place it before a wall, and take a photograph of the chair. This photo is to be enlarged to the size of the actual chair and placed on the wall to the left of the chair. Finally, a blow-up of the copy of the dictionary definition is to be hung to the right of the chair, its upper edge aligned with that of the photograph.'),('/m/05ccx1s','\"A Studio at Les Batignolles\" (1870) is a painting by French artist Henri Fantin-Latour.'),('/m/05cq6n1','Four-Sided Pyramid is a conceptual modular \"structure\", by Sol LeWitt, in the National Gallery of Art Sculpture Garden.\nThe artist created a plan and Four-Sided Pyramid was constructed by others, in 1999.'),('/m/05cy4z','The Gilded Cage is an oil painting by Evelyn De Morgan, with apparent stylistic influences of spatial representation from Surrealist modes of thought, her final work before her death in 1919. It is essentially an allegory for female hypnotic delirium.\nIn this painting, a woman \"looks out\" from what seems to be a window that may, in fact, be a scene from a mural painting within the greater composition with her hand stretched out and up in a gesture of yearning. She is looking at what may be compared to a group of gypsy figures, dancing under the open sky. The principal figure among the travelling group is a woman who dances while holding her baby close to her, thus otherwise suggesting the scene is representional for an altered-state vision of maternal duty.\nSoaring free about the dancing group is a bird, which contrasts sharply to the captive bird in the gilded cage that hangs beside the woman\'s older husband. The husband seems distraught at his wife\'s deteriorated - or \"released\" - state of mind.'),('/m/05cz2q1','\"Woman with a Parasol - Madame Monet and Her Son\" (1875) is a painting by French Impressionist artist Claude Monet.'),('/m/05c_jpl','\"Camille (The Woman in the Green Dress)\" is a painting by French Impressionist artist Claude Monet.'),('/m/05c_js6','\"The Monet Family in Their Garden at Argenteuil\" (1874) is a painting by French Impressionist artist Édouard Manet.'),('/m/05f9b03','The Regatta at Sainte-Adresse is a painting by the impressionist painter Claude Monet. Signed: Claude Monet.\nThis painting and \"The Beach in Sainte-Adresse\" were probably conceived as a pair. They are identical in size, and their viewing point differs by only a few yards.\nSainte-Adresse, the well-to-do suburb of Le Havre, was the home of Monet\'s father. Destitute, Monet spent the summer of 1867 with his father and aunt Sophie Lecadre at the cost of abandoning his companion, Camille Doncieux, and their newborn son, Jean. Monet attended the birth in Paris and returned to the coast a few days later.\nThe pair of paintings juxtaposes this sunny regatta watched at high tide by well dressed bourgeois, with an overcast scene at low tide, fishing boats hauled onto the beach peopled with sailors and workers. Since Monet never exhibited the paintings side by side, the contrast between them was probably not intended as a social manifesto but instead reflected differing conditions under which the same place could be painted.\nOn 25 June 1867, Monet reported that he was working on about twenty pictures:\n\"Among the seascapes, I am doing the regattas of Le Havre with many figures on the beach and the outer harbor covered with small sails.\"'),('/m/05fb8zp','The Garden at Sainte-Adresse is a painting by the French impressionist painter, Claude Monet.. The painting was acquired by the Metropolitan Museum of Art after an auction sale at Christie\'s in December 1967, under the French title La terrasse à Sainte-Adresse. The painting was exhibited at the 4th Impressionist exhibition, Paris, April 10–May 11, 1879, as no. 157 under the title Jardin à Sainte-Adresse.\nMonet spent the summer of 1867 at the resort town of Sainte-Adresse on the English Channel, near Le Havre. It was there, in a garden with a view of Honfleur on the horizon, that he painted this picture, which combines smooth, traditionally rendered areas with sparkling passages of rapid, separate brushwork, and spots of pure colour.\nThe models were probably Monet\'s father, Adolphe, in the foreground, Monet\' cousin Jeanne Marguérite Lecadre at the fence; Dr. Adolphe Lecadre, her father; and perhaps Lecadre\'s other daughter, Sophie, the woman seated with her back to the viewer.\nAlthough the scene projects affluent domesticity, it is by no means a family portrait. Monet\'s relations with his father were tense that summer, owing to family disapproval of the young artist\'s liaison with his companion, Camille Doncieux.'),('/m/05krk','The Ohio State University, commonly referred to as Ohio State or OSU, is a public research university in Columbus, Ohio. Founded in 1870, as a land-grant university and ninth university in Ohio with the Morrill Act of 1862, the university was originally known as the Ohio Agricultural and Mechanical College. The college began with a focus on training students in various agricultural and mechanical disciplines but was developed into a comprehensive university under the direction of Governor Rutherford B. Hayes and in 1878 the Ohio General Assembly passed a law changing the name to \"The Ohio State University\". It has since grown into the third largest university campus in the United States. In 2007, Ohio State was officially designated as the flagship institution of Ohio\'s public universities as part of the newly centralized University System of Ohio. Along with its main campus in Columbus, Ohio State also operates a regional campus system with regional campuses in Lima, Mansfield, Marion, Newark, and Wooster.'),('/m/05mdjh','Lawrence Weiner is one of the central figures in the formation of conceptual art in the 1960s His work often takes the form of typographic texts.'),('/m/05msg7f','Self-Portrait is a 1986 work by the American artist Andy Warhol. The portrait is in a camouflage-patterned foreground with a black background.'),('/m/05qgh2p','Golden Wings and Other Stories is a collection of fantasy short stories by William Morris, first published in trade paperback by the Newcastle Publishing Company in March 1976 as the eighth volume of the celebrated Newcastle Forgotten Fantasy Library. The first hardcover edition was published by Borgo Press in 1980. The stories were originally published in The Oxford and Cambridge Magazine in 1856. More recently the stories have been combined with Morris\'s other contributions to the magazine, including reviews, essays and poems, to form the expanded collection The Hollow Land and Other Contributions to the Oxford and Cambridge Magazine, published by Forgotten Books in June, 2010.\nThe book contains short works of fiction by the author, together with an introduction by Alfred Noyes and an afterword by Richard B. Mathews.'),('/m/05qgkdn','The Roots of the Mountains: Wherein is Told Somewhat of the Lives of the Men of Burgdale, Their Friends, Their Neighbors, Their Foemen, and Their Fellows in Arms is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first published in hardcover by Reeves and Turner in 1889. Its importance in the history of fantasy literature was recognized by its republication by the Newcastle Publishing Company as the nineteenth volume of the celebrated Newcastle Forgotten Fantasy Library in April, 1979.\nAccording to Graham Seaman, \"The Roots of the Mountains seems to be the story that inspired the subplot of the Dunedain, wanderers of fading heroic past defending the frontiers of the Shire against the Orcs, and the loves of Aragorn, Eowyn, Faramir, and Arwen in Tolkien\'s Lord of the Rings.\"\nThis work and its predecessor, The House of the Wolfings, were to some degree historical novels, with little or no magic. Morris would go on to develop the new genre established in these works in such later fantasies as Child Christopher and Goldilind the Fair, The Wood Beyond the World, The Well at the World\'s End, and The Water of the Wondrous Isles.'),('/m/05qtj','Paris is the capital and most populous city of France. It is situated on the Seine River, in the north of the country, at the heart of the Île-de-France region. Within its administrative limits, the city had 2,243,833 inhabitants in 2010 while its metropolitan area is one of the largest population centres in Europe with more than 12 million inhabitants.\nAn important settlement for more than two millennia, by the late 12th century Paris had become a walled cathedral city that was one of Europe\'s foremost centres of learning and the arts and the largest city in the Western world until the turn of the 18th century. Paris was the focal point for many important political events throughout its history, including the French Revolution. Today it is one of the world\'s leading business and cultural centres, and its influence in politics, education, entertainment, media, science, fashion and the arts all contribute to its status as one of the world\'s major cities.'),('/m/060qm_','The United Kingdom general election of 2005 was held on Thursday, 5 May 2005 to elect 646 members to the British House of Commons. The Labour Party under Tony Blair won its third consecutive victory, but its majority now stood at 66 seats compared to the 160-seat majority it had previously held.\nThe Labour campaign emphasised a strong economy, however Blair had suffered a decline in popularity even before the decision to send British troops to invade Iraq in 2003. The Conservative Party, led by Michael Howard since late 2003, campaigned on policies, such as immigration limits, improving poorly managed hospitals and reducing high crime rates, all under the slogan \'Are you thinking what we\'re thinking?\'. The Liberal Democrats, led by Charles Kennedy were staunchly opposed to the Iraq War from the start and collected votes from disenchanted Labour voters.\nTony Blair was returned as Prime Minister, with Labour holding 355 MPs but with a popular vote of 35.2%, the lowest of any majority government in British history. In terms of votes they were only narrowly ahead of the Conservatives, but still had a comfortable lead ahead of them in terms of seats.'),('/m/062s1ly','\"Grand Canal, Venice\" (1908) is a painting by French artist Claude Monet.'),('/m/062s1mf','\"Palazzo Dario, Venice\" (1908) is a painting by French artist Claude Monet.'),('/m/062s1p9','\"Gondola in Venice\" (1908) is a painting by French artist Claude Monet.'),('/m/062s2vw','\"Claude Monet Painting by the Edge of a Wood\" (1885) is a painting by American artist John Singer Sargent.'),('/m/063j6w_','\"Le Bateau-atelier\" (1876) is a painting by French artist Claude Monet.'),('/m/063j6x2','\"Camille au métier\" (1875) is a painting by French artist Claude Monet.'),('/m/063jfhg','\"Poplar (Autumn)\" (1891) is one in a series of paintings of poplar trees by French Impressionist artist Claude Monet.'),('/m/063jfq9','\"Poplars in the Sun\" (1891) is one in a series of paintings of poplar trees by French Impressionist artist Claude Monet.'),('/m/063jfqk','\"The Four Trees\" (1891) is one in a series of paintings of four poplar trees by French Impressionist artist Claude Monet.\nMonet settled in Giverny, about forty-five miles northwest of Paris, in 1883. Although he took frequent trips, venturing as far as London and Venice, it was the landscape within a two-mile radius of his home that captured his attention for the rest of his life. With his famous \"Haystacks\" pictures, begun in 1890, Monet began to paint in series, often working on several canvases at once in order to capture the scene in changing light and weather conditions. \nDuring the summer and fall of 1891, he painted a series of canvases depicting the poplars along the Epte River, about a mile from his house. Because he did not paint the poplars from the opposite bank but instead from a boat in the middle of the river, we cannot see the tops of the four trees nearest us—only the vertical lines of their slender trunks. Furthermore, were it not for the horizontal of the riverbank, the tree trunks would be indistinguishable from their reflection in the water.'),('/m/063jfrc','\"Poplars (Autumn) II\" (1891) is one in a series of paintings of poplar trees by French Impressionist artist Claude Monet.'),('/m/063jfrm','\"Poplars (Wind effect)\" (1891) is one in a series of paintings of poplar trees by French Impressionist artist Claude Monet.'),('/m/063kgm6','\"Nympheas\" (1916) is a painting by French Impresionist artist Claude Monet.'),('/m/063khk9','\"Water Lilies\" (1908)  is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063k__q','\"Water Lilies (1907)  is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063k__z','\"Water Lilies\" (c. 1917-1919)  is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063l0jw','\"Water Lilies\" (c. 1914-1917) is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063l0q3','\"Nympheas\" (1915) is a painting by French Impressionist artist Claude Monet.'),('/m/063l13l','\"Three Trees in Grey Weather\" (1891) is one in a series of paintings of poplar trees by French Impressionist artist Claude Monet.'),('/m/063l319','\"Water Lily Pond\" (1900)   is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063l34t','The Water Lilies is a painting by impressionist Claude Monet painted during his series called Water Lilies. The painting depicts a scene in a French pond showing light reflecting off the water with Water Lilies on the surface. It was painted in 1919 and as of 2012 is on display in New York\'s Metropolitan Museum of Art.'),('/m/063l375','\"The Water Lily Pond\" (1899) is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063l3dp','\"Water Lilies\" (c. 1920-1926)   is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063l3l5','\"The Japanese Footbridge and the Water Lily Pool, Giverny\" (1899)    is one in a series of water lilies paintings by French Impressionist artist Claude Monet.'),('/m/063l423','\"Haystacks at the End of Summer, Morning Effect\" (1891) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/063l42c','\"Haystacks: Snow Effects\" (1890-1891) is a painting by French artist Claude Monet.'),('/m/063l42m','\"Haystacks (Midday)\" (1890-91) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/063l42w','\"Wheatstack\" (1890-91) is a painting by French artist Claude Monet.'),('/m/063l433','\"Grainstack in Sunshine\" (1891) is a painting by French artist Claude Monet.'),('/m/063l43c','\"Wheatstack (Thaw, Sunset)\" (1890-91) is a painting by French artist Claude Monet.'),('/m/063l43m','\"Grainstacks, White Frost Effect\" (1890) is a painting by French artist Claude Monet.'),('/m/063l43w','\"Wheatstack (Sun in the Mist)\" (1891) is a painting by French artist Claude Monet.'),('/m/063l443','\"Haystack, Morning Snow Effect\"  (1891) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/063l44c','\"Grainstacks, Snow Effect\"  (1890-91) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/063l44m','\"Wheatstacks\"  (1890-91) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/063l44w','\"Grainstack (Sunset)\" (1890-1891) is a painting by French artist Claude Monet.'),('/m/063l453','\"Wheatstacks (End of Summer)\" (1890-91) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/063l45c','\"Wheatstack (Snow Effect, Overcast day)\" (1890-91) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/063pwlk','\"Grainstack at Giverny\" (1889) is one in a series of Haystack-themed paintings by French artist Claude Monet.'),('/m/065v8gd','\"Nymphs Finding the Head of Orpheus\" (1900) is a painting by English artist John William Waterhouse.'),('/m/0669vsy','On Art and Life is a book by John Ruskin.'),('/m/06flg','Reykjavík is the capital and largest city of Iceland. Its latitude, at 64°08\' N, makes it the world\'s northernmost capital of a sovereign state. It is located in southwestern Iceland, on the southern shore of the Faxaflói Bay. With a population of around 120,000, it is the heart of Iceland\'s cultural, economic and governmental activity.\nReykjavík is believed to be the location of the first permanent settlement in Iceland, which Ingólfur Arnarson is said to have established around AD 870. Until the 18th century, there was no urban development in the city location. The city was founded in 1786 as an official trading town and grew steadily over the next decades, as it transformed into a regional and later national centre of commerce, population, and governmental activities. It is among the cleanest, greenest, and safest cities in the world.'),('/m/06n3yp2','The Story of Sigurd the Volsung and the Fall of the Niblungs is an epic poem of over 10,000 lines by William Morris that tells the tragic story, drawn from the Volsunga Saga and the Elder Edda, of the Norse hero Sigmund, his son Sigurd and Sigurd\'s wife Gudrun. It sprang from a fascination with the Volsung legend that extended back twenty years to the author\'s youth, and had already resulted in several other literary and scholarly treatments of the story. It was Morris\'s own favourite of his poems, and was enthusiastically praised both by contemporary critics and by such figures as T. E. Lawrence and George Bernard Shaw. In recent years it has been rated very highly by many William Morris scholars, but has never succeeded in finding a wide readership on account of its great length and archaic diction. It has been seen as an influence on such fantasy writers as Andrew Lang and J. R. R. Tolkien. The Story of Sigurd is available in modern reprints, both in its original form and in a cut-down version, but there is no critical edition.'),('/m/06w1y3','Vernon Martin Ingram, Ph.D., FRS was a German American professor of biology at the Massachusetts Institute of Technology.'),('/m/070pzwf','The Calling of Perseus (1877-1898) is a painting by British artist Edward Burne-Jones.'),('/m/070pzwm','The Doom Fulfilled (1888) is a painting by British artist Edward Burne-Jones.'),('/m/070pzwt','The Baleful Head (c. 1886-1887) is a painting by British artist Edward Burne-Jones.'),('/m/070pzx2','The Finding of Medusa (c. 1888-1892) is a painting by British artist Edward Burne-Jones.'),('/m/070pzx8','Perseus and the Graiae (1892) is a painting by British artist Edward Burne-Jones.'),('/m/070pzxh','The Rock of Doom (c. 1885-1888) is a painting by British artist Edward Burne-Jones.'),('/m/070rl87','The Death of Medusa (c. 1888-1892) is a painting by British artist Edward Burne-Jones.'),('/m/071lhw1','The Birth of Pegasus and Chrysaor (c. 1876-1885) is a painting by British artist Edward Burne-Jones.'),('/m/071ljl9','Atlas Turned to Stone (1882) is a painting by British artist Edward Burne-Jones.'),('/m/073swq','The King of the Golden River or The Black Brothers: A Legend of Stiria by John Ruskin was originally written in 1841 for the twelve-year-old Effie Gray, whom Ruskin later married. It was published in book form in 1851, and became an early Victorian classic which sold out three editions. In the \"Advertisement to the First Edition,\" which prefaces it, it is called a fairy tale, one, it might be added, that illustrates the triumph of love, kindness, and goodness over evil; however, it could also be characterized as a fable, a fabricated aetiological myth or etiology, and a parable. It was illustrated with 22 illustrations by Richard Doyle.'),('/m/075v8lx','La gare Saint-Lazare (1877) is a painting by French artist Claude Monet.'),('/m/075vbf7','Gare Saint-Lazare: Arrival of a Train (1877) is an oil on canvas painting by French artist Claude Monet.'),('/m/075vbvt','Gare Saint-Lazare, the Western Region Goods Sheds (1877) is a painting by French artist Claude Monet.'),('/m/075vb_b','Train Tracks at the Saint-Lazare Station (1877) is a painting by French artist Claude Monet.'),('/m/075vcd2','La gare Saint-Lazare, Les signaux (1877) is a painting by French artist Claude Monet.'),('/m/075z4xp','Strayed Sheep (Our English Coasts) (1852) is a painting by British artist William Holman Hunt.'),('/m/075z4z2','May Morning on Magdalen Tower (1891) is a painting by British artist William Holman Hunt.'),('/m/075z4_t','Bianca (1868-1869) is a painting by British artist William Holman Hunt.'),('/m/0761g_b','Le Déjeuner sur l\'Herbe (1865-1866) is a painting by French artist Claude Monet.'),('/m/07622gx','Rue Montargueil with Flags (1878) is a painting by French artist Claude Monet.'),('/m/079rj_l','The Railroad Bridge Viewed from the Port (1872) is a painting by French artist Claude Monet.'),('/m/079rk47','La Pointe de la Hève at Low Tide (1865) is a painting by French artist Claude Monet.'),('/m/079rkdy','Houses of Parliament (1904) is a painting by French artist Claude Monet.'),('/m/079rkz6','Parliament, Effect of Fog (1904) is a painting by French artist Claude Monet.'),('/m/079rl66','Monet Painting in his Garden at Argenteuil (1873) is a painting by French artist Pierre-Auguste Renoir.'),('/m/07k8p9q','Bocca Baciata is a painting by Dante Gabriel Rossetti which represents a turning point in his career. It was the first of his pictures of single female figures, and established the style that was later to become a signature of his work. The model was Fanny Cornforth, the principal inspiration for Rossetti\'s sensuous figures.\nThe title, meaning \"mouth that has been kissed\", refers to the sexual experience of the subject and is taken from the Italian proverb written on the back of the painting:\nBocca baciata non perde ventura, anzi rinnova come fa la luna.\n‘The mouth that has been kissed does not lose its savour,\nindeed it renews itself just as the moon does.’\nRossetti, an accomplished translator of early Italian literature, probably knew the proverb from Boccaccio’s Decameron where it is used as the culmination of the tale of Alatiel: a beautiful Saracen princess who, despite having had sex on perhaps ten thousand occasions with eight separate lovers in the space of four years, successfully presents herself to the King of the Algarve as his virgin bride.\nRossetti explained in a letter to William Bell Scott that he was attempting to paint flesh more fully, and to \"avoid what I know to be a besetting fault of mine - & indeed rather common to PR painting - that of stipple in the flesh...Even among the old good painters, their portraits and simpler pictures are almost always their masterpieces for colour and execution; and I fancy if one kept this in view, one might have a better chance of learning to paint at last.\"'),('/m/07qvwg','Dom George Frederick James Temple FRS OSB was an English mathematician, recipient of the Sylvester Medal in 1969. He was President of the London Mathematical Society in the years 1951-1953.\nTemple took his first degree as an evening student at Birkbeck College, London, between 1918 and 1922, and also worked there as a research assistant. In 1924 he moved to Imperial College as a demonstrator, where he worked under the direction of Sydney Chapman. After a period spent with Eddington at Cambridge, he returned to Imperial as reader in mathematics. He was appointed professor of mathematics at King\'s College London in 1932, where he returned after war service with the Royal Aircraft Establishment at Farnborough. In 1953 he was appointed Sedleian Professor of Natural Philosophy at the University of Oxford, a chair which he held until 1968, and in which he succeeded Chapman. He was also an honorary Fellow of Queen\'s College, Oxford.\nAfter the death of his wife in 1980, Temple, a devout Christian, took monastic vows in the Benedictine order and entered Quarr Abbey on the Isle of Wight, where he remained until his death.'),('/m/07sgkrs','\"Soliloquy\" is a photography art series by British artist Sam Taylor-Wood.'),('/m/07ybqsn','The 2006 London Film Festival was held from 10/18/2006 to 11/2/2006.'),('/m/07ybqwh','The 2004 London Film Festival was held from October 20 to November 4, 2004.'),('/m/07ybqy7','2005 London Film Festival was held from October 19 to November 3, 2005.'),('/m/08304','William Morris was an English textile designer, poet, novelist, translator, and revolutionary socialist. As a designer, he was associated with the English Arts and Crafts Movement and was a major contributor to the revival of traditional textile arts and methods of production in Britain. His literary contributions helped to establish the modern fantasy genre.\nBorn in Walthamstow, Essex to a wealthy middle-class family, Morris came under the strong influence of medievalism while studying Classics at Oxford University, there joining the Birmingham Set. After university he trained as an architect, married Jane Burden, and developed close friendships with the Pre-Raphaelite artists Edward Burne-Jones and Dante Gabriel Rossetti and with the Neo-Gothic architect Philip Webb. Webb and Morris designed a family home, Red House in Kent, where the latter lived from 1859 to 1865, before relocating to Bloomsbury, central London. In 1861, Morris founded a decorative arts firm with Burne-Jones, Rossetti, Webb, and others: the Morris, Marshall, Faulkner & Co.'),('/m/08676z','Leonard Mandel was the Lee DuBridge Professor Emeritus of Physics and Optics at the University of Rochester when he died at the age of 73 at his home in Pittsford, New York. He contributed immensely to theoretical and experimental optics. With Emil Wolf he published the highly regarded book Optical Coherence and Quantum Optics.\nMandel was born in Berlin, Germany, where his father had emigrated from Eastern Europe. He received a BSc degree in mathematics and physics in 1947 and a PhD degree in nuclear physics in 1951 from Birkbeck College, University of London, in the United Kingdom. He became a technical officer at Imperial Chemical Industries Ltd in Welwyn, UK, in 1951. In 1955, he became a lecturer and, later, senior lecturer at Imperial College London, University of London. He remained at Imperial until 1964, when he joined the University of Rochester as a professor of physics.'),('/m/08fc1w','The Portrait of a Young Woman is a painting by the Italian High Renaissance master Raphael, made between 1518 and 1520. It is in the Galleria Nazionale d\'Arte Antica in Palazzo Barberini, Rome.\nIt is probable that the picture was in the painter\'s studio at his death in 1520, and that it was modified and then sold by his assistant Giulio Romano. In the 16th century the picture was in the house of the Countess of Santafiora, a Roman noblewoman, and subsequently became property of the Duke Boncompagni and then of the Galleria Nazionale which still possesses it.\nThe woman is traditionally identified with the fornarina Margherita Luti, Raphael\'s Roman lover, though this has been questioned. The woman is pictured with an oriental style hat and bare breasts. She is making the gesture to cover her left breast, or to turn it with her hand, and is illuminated by a strong light coming from outside. Her left arm has a narrow band carrying the signature of the artist, RAPHAEL URBINAS. It has been suggested that the right hand on the left breast reveals a cancerous breast tumour disguised in a classic pose of love.'),('/m/08gb0c','The Police Strikes of 1918 and 1919 resulted in the British government putting before Parliament its proposals for a Police Act, which established the Police Federation of England and Wales as the representative body for the police. The Act also barred police from belonging to a trade union or affiliating with any other trade union body. This Act, drafted and passed into law, was as a direct response to the emergence of the National Union of Police and Prison Officers. A successful police strike in 1918 and another strike in June 1919 led to the suppression of the union by the government. On 1 August 1919, the Police Act of 1919 passed into law. Only token opposition from a minority of Labour Members of Parliament was voiced in Parliament.'),('/m/08m57d','The Madonna dell\'Impannata is a painting by the Italian High Renaissance painter Raphael.'),('/m/08myfl','The Young Man with an Apple is a painting by the Italian High Renaissance painter Raphael. It is housed in the Uffizi Gallery in Florence. Made during the artist\'s Florentine period, it is often thought to be the portrait of Francesco Maria I Della Rovere.'),('/m/08myw4','St. Michael is an oil painting by Italian artist Raphael. Also called the Little St. Michael to distinguish it from a larger, later treatment of the same theme, St. Michael Vanquishing Satan, it is housed in the Louvre in Paris. The work depicts the Archangel Michael in combat with the demons of Hell, while the damned suffer behind him. Along with St. George, it represents the first of Raphael\'s works on martial subjects.'),('/m/08n3y8','The St. Cecilia Altarpiece is an oil painting by Italian High Renaissance painter Raphael. Completed in his later years, around 1516-1517, the painting depicts Saint Cecilia, the patron saint of musicians and Church music, listening to a choir of angels in the company of St. Paul, St. John the Evangelist, St. Augustine and Mary Magdalene. Commissioned for a church in Bologna, the painting now hangs there in the Pinacoteca Nazionale, or National Painting Gallery. According to Vasari the musical instruments strewn about Cecilia\'s feet were not painted by Raphael, but by his student, Giovanni da Udine.\nIn 1880, English Romantic poet Percy Shelley described the painting as follows:\nThe central figure, St. Cecilia, seems rapt in such inspiration as produced her image in the painter\'s mind; her deep, dark, eloquent eyes lifted up; her chestnut hair flung back from her forehead — she holds an organ in her hands — her countenance, as it were, calmed by the depth of its passion and rapture, and penetrated throughout with the warm and radiant light of life. She is listening to the music of heaven, and, as I imagine, has just ceased to sing, for the four figures that surround her evidently point, by their attitudes, towards her; particularly St. John, who, with a tender yet impassioned gesture, bends his countenance towards her, languid with the depth of emotion. At her feet lie various instruments of music, broken and unstrung.'),('/m/08nczz','The Madonna and Child with an Angel is a painting by the Italian Renaissance painter Sandro Botticelli, c. 1465-1467. It is housed in Spedale degli Innocenti of Florence.\nThe painting, one of Botticelli\'s earliest, reveals Botticelli\'s close artistic relationship with his teacher, Filippo Lippi, and is modelled on the latter\'s The Virgin and Child with Two Angels.'),('/m/08nyct','The Tempi Madonna is an oil painting by the Italian High Renaissance painter Raphael. Painted for the Tempi family, it was bought by Ludwig I of Bavaria in 1829. It is housed in the Alte Pinakothek in Munich. It is thought to have been made in 1508, at the end of the artist\'s Florentine period.'),('/m/08pcjm','Portrait of a Man with a Medal of Cosimo the Elder, also known as Portrait of a Youth with a Medal, is a tempera painting by Italian Renaissance painter Sandro Botticelli. The painting features a young man displaying in triangled hands a medal stamped with the likeness of Cosimo de\' Medici. The identity of the young man has been a long-enduring mystery. Completed in approximately 1475, it is on display in the Uffizi Gallery of Florence.'),('/m/08pkk1','Portrait of a Young Man is a painting by the Italian Renaissance artist Sandro Botticelli, circa 1483. It is housed in the National Gallery of London.\nThis was originally attributed to Giorgione, Filippino Lippi or Masaccio and is the only known en face portrait by Botticelli.'),('/m/08pkmy','The Annunciation, also known as the Cestello Annunciation, is a tempera painting by the Italian Renaissance master Sandro Botticelli, circa 1489-1490. It is housed in the Uffizi Gallery of Florence.\nThe picture was commissioned in 1489 by the church of the Florentine convent of Cestello which is now known as Santa Maria Maddalena de\'Pazzi.\nUnderneath the painting on its original frame are words in Latin from St. Luke\'s Gospel 1:35 \"The Holy Ghost shall come upon thee, and the power of the Highest shall overshadow thee.\"'),('/m/08pvk5','The Canigiani Holy Family or Canigiani Madonna is a painting by the Italian High Renaissance artist Raphael. It is in the Alte Pinakothek of Munich, Germany.'),('/m/08pxxr','The Marriage of the Virgin, also known as Lo Sposalizio, is an oil painting by Italian High Renaissance artist Raphael. Completed in 1504 for a Franciscan church in Città di Castello, the painting depicts a marriage ceremony between Mary and Joseph. It changed hands several times before settling in 1806 at the Pinacoteca di Brera.'),('/m/08r46c','Christ Falling on the Way to Calvary, also known as Lo Spasimo or Il Spasimo di Sicilia, is a painting by the Italian High Renaissance painter Raphael, of circa 1514–16, now in the Museo del Prado in Madrid. It is an important work for the development of his style.'),('/m/08rz25','The Calumny of Apelles is a tempera painting by Italian Renaissance painter Sandro Botticelli. Based on the description of a painting by Apelles, the work was completed in approximately 1494. It is on display in the Uffizi in Florence.'),('/m/08yk4y','Oswald Hanfling was a German philosopher who worked until his death at the Open University in the UK.'),('/m/08yp69','The Madonna of Loreto is a painting finished around 1508-1509 by the Italian High Renaissance painter Raphael. It is housed in the Musée Condé of Chantilly, France.\nFor centuries the painting kept company with the Portrait of Pope Julius II, first at the Santa Maria del Popolo, then in private collections, and for a time their location was unknown. Their ownership, or provenance, has been difficult to unravel because of the number of copies of both paintings, the unclear ownership chain, misinformation and delay of publication of vital information.\nFor instance, this painting received its name from a copy at the Basilica della Santa Casa in Loreto which was at one time thought to be the original. Now is it certain that the painting at Loreto was a copy - and therefore the painting name is a misnomer.\nEven so, the well-copied painting has been a beloved and critically acclaimed painting for centuries.'),('/m/095l0','Bristol is a city, unitary authority area and ceremonial county in South West England, with an estimated population of 437,492 for the unitary authority in 2013, and a surrounding Larger Urban Zone with an estimated 1.07 million residents in 2007. It is England\'s sixth and the United Kingdom\'s eighth most populous city, one of the Core Cities Group and the most populous city in South West England.\nThe city received a Royal charter in 1155. It was part of Gloucestershire until 1373 when it became a county in its own right. From the 13th century, for half a millennium, it ranked among the top three English cities after London, alongside York and Norwich, on the basis of tax receipts, until the rapid rise of Liverpool, Birmingham and Manchester during the Industrial Revolution in the later 18th century. It borders the counties of Somerset and Gloucestershire, and is also located near the historic cities of Bath to the south east and Gloucester to the north. The city is built around the River Avon, and it also has a short coastline on the Severn Estuary, which flows into the Bristol Channel.\nBristol is the largest centre of culture, employment and education in the region.'),('/m/09c7b','The Metropolitan Museum of Art, located in New York City, is the largest art museum in the United States, and one of the ten largest in the world, with the most significant art collections. Its permanent collection contains more than two million works, divided among seventeen curatorial departments. The main building, located on the eastern edge of Central Park along Manhattan\'s Museum Mile, is by area one of the world\'s largest art galleries. There is also a much smaller second location at \"The Cloisters\" in Upper Manhattan that features medieval art.\nRepresented in the permanent collection are works of art from classical antiquity and Ancient Egypt, paintings and sculptures from nearly all the European masters, and an extensive collection of American and modern art. The Met also maintains extensive holdings of African, Asian, Oceanic, Byzantine, and Islamic art. The museum is also home to encyclopedic collections of musical instruments, costumes and accessories, and antique weapons and armor from around the world. Several notable interiors, ranging from 1st-century Rome through modern American design, are permanently installed in the Met\'s galleries.'),('/m/09c7w0','The United States of America, commonly referred to as the United States, America, and sometimes the States, is a federal republic consisting of 50 states and a federal district. The 48 contiguous states and Washington, D.C., are in central North America between Canada and Mexico. The state of Alaska is the northwestern part of North America and the state of Hawaii is an archipelago in the mid-Pacific. The country also has five populated and nine unpopulated territories in the Pacific and the Caribbean. At 3.79 million square miles in total and with around 318 million people, the United States is the third-largest country by total area and third or fourth-largest by land area, as well as third-largest by population. It is one of the world\'s most ethnically diverse and multicultural nations, the product of large-scale immigration from many countries. The geography and climate of the United States is also extremely diverse, and it is home to a wide variety of wildlife.\nPaleo-Indians migrated from Eurasia to what is now the U.S. mainland around 15,000 years ago, with European colonization beginning in the 16th century.'),('/m/09cw9w','Fanny Cornforth was an English woman who became the artist\'s model and mistress of the Pre-Raphaelite painter Dante Gabriel Rossetti. Later, Cornforth performed the duties of housekeeper for Rossetti.\nWilliam Michael Rossetti, the artist\'s brother, wrote that \"she was a pre-eminently fine woman with regular and sweet features, and a mass of the most lovely blond hair – light-golden, or \'harvest yellow\'.\"\nIn Rossetti\'s paintings, the figures modeled by Fanny Cornforth are generally rather voluptuous, differing from those of other models such as Jane Morris and Elizabeth Siddal.'),('/m/09l_t8','Schenley High School, located in the North Oakland neighborhood at the edge of the Hill District in Pittsburgh, Pennsylvania, is a historic building opened in 1916 that was part of the Pittsburgh Public Schools. Schenley relocated its staff and students to the former Reizenstein Middle School building in 2008 and graduated its final class in 2011. A few months later, the school district placed the Schenley High School building up for sale. On February 28, 2013 the Pittsburgh School Board approved the sale of Schenley High School to the PMC Property Group of Philadelphia in a 5-4 vote.\nThe Schenley building is listed on the National Register of Historic Places. and the Pittsburgh History and Landmarks Foundation Register. It is also a contributing property in the Schenley Farms Historic District.'),('/m/09q_1j','The Battle of Neuve Chapelle took place in the First World War. It was a British offensive in the Artois region of France and broke through at Neuve-Chapelle but the British were unable to exploit the success. More troops had arrived from Britain and relieved some French troops in Flanders, which enabled a continuous British line to be formed, from Givenchy-lès-la-Bassée north to Langemarck. The battle was intended to cause a rupture in the German lines, which would then be exploited with a rush to the Aubers Ridge and possibly Lille. A French assault at Vimy Ridge on the Artois plateau was also planned to threaten the road, rail and canal junctions at La Bassée from the south, as the British attacks menaced it from the north. If the French Tenth Army captured Vimy Ridge and the north end of the Artois plateau from Lens to La Bassée, as the British First Army took Aubers Ridge from La Bassée to Lille, a further advance of 10–15 miles would cut the roads and railways used by the Germans to supply the troops in the Noyon Salient, from Arras south to Rheims.'),('/m/09rpk16','Ophelia (1889) is a painting by English Pre-Raphaelite painter John William Waterhouse.'),('/m/09rpkbm','Ophelia (1894) is a painting by English Pre-Raphaelite painter John William Waterhouse.'),('/m/09rpkc2','Ophelia (1910) is a painting by English Pre-Raphaelite artist John William Waterhouse.'),('/m/09v7rth','Gather Ye Rosebuds While Ye May is an oil painting on canvas created in 1908 by British Pre-Raphaelite artist, John William Waterhouse. It was the first of two paintings inspired by the 17th century poem \"To the Virgins, to Make Much of Time\" by Robert Herrick which begins:\nGather ye rosebuds while ye may,\nOld Time is still a-flying;\nAnd this same flower that smiles today\nTomorrow will be dying.'),('/m/09v9rqm','Beach in Pourville is a painting by French artist Claude Monet. It was painted in 1882, one of a series of oil-on-canvas works made by Monet that year in the small seaside resort of Pourville-sur-Mer, near Dieppe in northern France. Monet is considered one of the most important members of the group of painters identified as the Impressionists. The painting was bought by the National Museum, Poznań, Poland in 1906 and exhibited in the display of their collection.'),('/m/09vb52v','The Houses of Parliament, Sunset (1903) is one in a series of paintings of the Palace of Westminster by French Impressionist artist Claude Monet.'),('/m/0b34d','The United States presidential election of 1900 was the 29th quadrennial presidential election, held on Tuesday, November 6, 1900. The election was a re-match of the 1896 race between Republican candidate and incumbent President William McKinley and his Democratic challenger, William Jennings Bryan. The Republican Convention chose New York Governor Theodore Roosevelt as McKinley\'s running mate, since Vice-President Garret Hobart had died from heart failure in 1899. The return of economic prosperity and recent victory in the Spanish–American War for control of the Philippines helped McKinley to score a decisive victory, while Bryan\'s anti-imperialist stance and continued support for bimetallism attracted only limited support.'),('/m/0b6htgj','26 October 1993 is an artwork created in 1993 as a collaboration between English artists Henry Bond and Sam Taylor-Wood, both of whom were involved in the Young British Artists scene of contemporary art. It is a pastiche or remaking of a well-known photographic portrait of John Lennon and Yoko Ono that was made by Annie Leibovitz a few hours before Lennon\'s murder.'),('/m/0b6kfr4','Snow at Argenteuil is an oil-on-canvas landscape painting from the Impressionist artist Claude Monet. It is the largest of no fewer than eighteen works Monet painted of his home commune of Argenteuil while it was under a blanket of snow during the winter of 1874-1875. This painting—number 352 in Wildenstein’s catalogue of the works of Monet—is the largest of the eighteen. The attention to detail evident in the smaller paintings is less evident in this larger picture. Instead, Monet has rendered large areas of the canvas in closely like tones and colours of blue and grey. The application of smaller strokes of greens, yellows, reds and darker blues breaks up these large expanses, and the almost choreographed dispersal of these various colours helps bind the picture together. Paint at the depicted road surface is thicker than elsewhere in the painting, and impasto is suggestive of the feel of disturbed snow.\nMost of Monet’s Snow at Argenteuil pictures from the winter of 1874-1875 were painted from locations close to the house on the boulevard Saint-Denis into which Monet and his family had just moved.'),('/m/0b6z0dn','Rose Trellises in Giverny (c. 1922) is a painting by French artist Claude Monet.'),('/m/0b9gtl','The Hireling Shepherd is a painting by the Pre-Raphaelite artist William Holman Hunt. It represents a shepherd neglecting his flock in favour of an attractive country girl to whom he shows a death\'s-head hawkmoth. The meaning of the image has been much debated.\nHunt painted the picture when he was working in close collaboration with John Everett Millais, who was painting Ophelia at the same time in the same region of Surrey. Both paintings depict English rural scenes, the innocence of which is disturbed by subtle but profoundly threatening violations of natural harmony. In Hunt\'s painting, the shepherd ignores his flock of sheep, who wander over a ditch into a field of corn. This violation of boundaries is paralleled by the shepherd\'s physical intrusions into the personal space of the young woman, who responds in an ambiguous way that might be interpreted as complicity or as a knowing scepticism. As he shows her the moth, he places his arm round her shoulder.'),('/m/0bbx_fp','Women in the Garden is an oil painting begun in 1866 by French artist Claude Monet when he was 26. It is a large work painted en plein air; the size of the canvas necessitated Monet painting its upper half with the canvas lowered into a trench he had dug, so that he could maintain a single point of view for the entire work. The setting is the garden of a property he was renting. His companion Camille posed for the figures. Monet finished the work indoors, and used magazine illustrations to render fashionable clothing.\nMonet at this time was early in his career, experimenting with method and subject matter. His earlier paintings were successful at Paris Salons, but Women in the Garden was rejected in 1867 on the grounds of subject and narrative weakness. The Salon was also troubled by Monet\'s heavy brushstrokes, a style which would, of course, become one of the hallmarks of Impressionism. A judge commented, \"Too many young people think of nothing but continuing in this abominable direction. It is high time to protect them and save art!\" The painting was purchased by fellow artist Frédéric Bazille to help support Monet at a time when he had no money.'),('/m/0bc5t4','\"The Haystack in the Floods\" is a narrative poem of 160 lines by William Morris, the famous writer and designer, first published in The Defence of Guenevere, and Other Poems in 1858. It is probably his best-known poem. It is a grimly realistic piece set in France during the Hundred Years\' War. The doomed lovers Jehane and Robert de Morny flee with a small escort through a convincingly portrayed rain-swept countryside, to reach the safety of English-held Gascony. They are however intercepted by the treacherous Godmar and have a last despairing parting besides the \"old soaked hay\" of the title. The encounter takes place shortly after the Battle of Poitiers but the characters Godmar and Jehane are entirely fictional. Morris used the name of an English knight Sir Robert de Morny, who was born in Essex and fought at Poitiers but who did not die in the manner recited.'),('/m/0bh77gn','The Stormy Sea in Étretat is an 1883 painting by founder of French impressionist Claude Monet, now preserved at the Musée des Beaux-Arts de Lyon.\nThe painting depicts a stormy sea on a winter day. The cliff that can be seen is that of Étretat, as Monet stayed in the city many times from the winter 1864-1865, and wrote: \"I spend my time outdoors on the stone when it\'s big time [...] and of course I work all the time.\" Monet composed the painting in February 1883 from the window of the hotel he lived then. Subsequently, the painting was bought by the Parisian dealer Paul Durand-Ruel, then became the property of the Museum of Fine Arts in Lyon in 1902. The museum thus became a precursor gaining early in the twentieth century Impressionist paintings.\nThe painting is composed of four major elements, each painted in a different way. The central part is invaded by the pearlized surfs painted in forms of commas. In the foreground, a small beach on which there are old boats filled with thatch on the left, and two fishermen with their boats in poor condition that ran aground on the shore. On the left, in the background, the cliff of Étretat can be seen and the rock strata are evoked by horizontal lines of brush. Finally, the upper part of the painting shows the sky, painted in a way that expresses a curtain of rain.'),('/m/0bmc8r_','Eight Elvises is a 1963 silkscreen painting by American pop artist Andy Warhol. In 2008 it was sold for $100 million to a private buyer, making the painting the most valuable work by Andy Warhol at the time. The current owner and location of the painting, which has not been seen publicly since the 1960s, are unknown.'),('/m/0bmvm6','Saint-Georges majeur au crépuscule is an Impressionist painting by Claude Monet completed between 1908 and 1912. It forms part of a series of views of the monastery-island of San Giorgio Maggiore begun in 1908 during his only visit to Venice.\nMonet felt Venice was a city \"too beautiful to be painted\", which may be why he returned with many paintings unfinished to Giverny, his home in France. However, he had already abandoned his earlier practice of painting from life, in front of the subject; instead he worked on the Venetian scenes at home. The death of his wife Alice in 1911 seems to have been a factor in their completion. In 1912 he held a successful exhibition at the gallery Bernheim-Jeune in Paris, where the painting was acquired by the Welsh art collector Gwendoline Davies. She bequeathed it to the Art Gallery in Cardiff, Wales.\nThe piece is a life study view of San Giorgio Maggiore, focusing on the Church of San Giorgio Maggiore, its bell tower, against the small island at sunset. To the right are the faintly visible domes of Santa Maria della Salute and the mouth of the Grand Canal.'),('/m/0bqqyxy','Monet (1840-1926) is a written work by Claude Monet.'),('/m/0btyn3r','Lilith (1887) is a painting by British artist John Collier.'),('/m/0bxjtrx','The Virgin Adoring the Child (c. 1490) is a painting by Italian artist Sandro Botticelli.'),('/m/0c1t1zv','Claude Monet at the time of Giverny is a written work by Claude Monet.'),('/m/0c1t1zy','Claude Monet: the early years is a written work by Claude Monet.'),('/m/0c1t1_0','Monet in the Museum of Fine Arts, Boston is a written work by Claude Monet.'),('/m/0c43g','Raffaello Sanzio da Urbino, better known simply as Raphael, was an Italian painter and architect of the High Renaissance. His work is admired for its clarity of form and ease of composition and for its visual achievement of the Neoplatonic ideal of human grandeur. Together with Michelangelo and Leonardo da Vinci, he forms the traditional trinity of great masters of that period.\nRaphael was enormously productive, running an unusually large workshop and, despite his death at 37, leaving a large body of work. Many of his works are found in the Vatican Palace, where the frescoed Raphael Rooms were the central, and the largest, work of his career. The best known work is The School of Athens in the Vatican Stanza della Segnatura. After his early years in Rome much of his work was executed by his workshop from his drawings, with considerable loss of quality. He was extremely influential in his lifetime, though outside Rome his work was mostly known from his collaborative printmaking.'),('/m/0c50vr','Liam Gillick is a British conceptual artist who lives in New York City. He is often associated with the artists included the 1996 exhibit Traffic, which first introduced the term Relational Art.'),('/m/0c8q2_','The Portrait of a Young Woman, also known as La Muta, is a portrait by the Italian Renaissance artist Raphael, c. 1507-1508. It is housed in the Galleria Nazionale delle Marche, in Urbino.\nThe picture portrays an unknown noblewoman over a near-black background, showing some Leonardesque influences. Although only recently attributed to Raphael, it is ranked among the best portraits by his hand.\nThe neatness of the large areas of colour which emerge in lighter tones from the background, and the analytical treatment of the details of the woman\'s clothing are characteristic of Raphael. The dispersive effect of this attention to detail is fully compensated by the tones of colour - used here in a fairly limited range - which unify the composition as a whole.\nX-ray analysis have showed the presence of an early Raphael years drawing under the painting, showing a female, young face with soft features, with later modifications.'),('/m/0cblyt','Julian Opie is a visual artist, and one of the New British Sculpture movement.'),('/m/0chsj1','Madonna in Glory with Seraphim is a painting by the Italian Renaissance painter Sandro Botticelli, executed c. 1469-1470. It is housed in Galleria degli Uffizi of Florence.\nSome panel paintings of the Madonna by Botticelli remain from the years around 1470 which are striking expressions of Botticelli\'s stylistic development. Two full figure pictures of the Madonna - the Madonna in Glory and the Madonna of the Rosegarden - are in the Uffizi. They represent monumental seated figures filling the entire picture.\nMary is enthroned on clouds in a glory of seraphim. The Christ Child, with the cruciform nimbus, is looking towards the observer and raising his hand in blessing. Botticelli has succeeded in expressing the tensions in this theme with sensitivity: the mother, who is fully aware of the Passion her son will suffer, is holding him protectively in her arms.'),('/m/0cm2xh','World War I, also known as the First World War, was a global war centred in Europe that began on 28 July 1914 and lasted until 11 November 1918. From the time of its occurrence until the approach of World War II, it was called simply the World War or the Great War, and thereafter the First World War or World War I. In America, it was initially called the European War. More than 9 million combatants were killed; a casualty rate exacerbated by the belligerents\' technological and industrial sophistication, and tactical stalemate. It was one of the deadliest conflicts in history, paving the way for major political changes, including revolutions in many of the nations involved.\nThe war drew in all the world\'s economic great powers, which were assembled in two opposing alliances: the Allies and the Central Powers of Germany and Austria-Hungary. Although Italy had also been a member of the Triple Alliance alongside Germany and Austria-Hungary, it did not join the Central Powers, as Austria-Hungary had taken the offensive against the terms of the alliance.'),('/m/0cmbcfy','Moon Museum is a small ceramic wafer three-quarters of an inch by half an inch in size, containing artworks by six prominent artists from the late 1960s. The artists with works in the \"museum\" are Robert Rauschenberg, David Novros, John Chamberlain, Claes Oldenburg, Forrest Myers, and Andy Warhol.\nThis wafer was supposedly covertly attached to a leg of the Intrepid landing module, and subsequently left on the moon during Apollo 12. The moon museum is considered the first Space Art object. While it is impossible to tell if the Moon Museum is actually on the moon without sending another mission to look, many other personal effects were smuggled onto the Apollo 12 lander and hidden in the layers of gold blankets that wrapped parts of the spacecraft.'),('/m/0cwt70','Campaignbox\nCaucasus\nPersia\nGallipoli\nMesopotamia\nSinai and Palestine\nArab Revolt\nSouth Arabia\nSouth-West Africa\nTogoland\nCameroon\nEast Africa\nNorth Africa\nU-boat\nAtlantic Ocean\nMediterranean\n\nAlthough considerable conflict took place outside Europe, the European theatre was the main theatre of operations during World War I and was where the war began and ended. During the four years of conflict, battle was joined by armies of unprecedented size equipped with new mechanized technologies, leaving millions dead or wounded.'),('/m/0cwx_','Carnegie Mellon University is a private research university in Pittsburgh, Pennsylvania.\nThe university began as the Carnegie Technical Schools founded by Andrew Carnegie in 1900. In 1912, the school became the Carnegie Institute of Technology and began granting four-year degrees. In 1967, the Carnegie Institute of Technology merged with the Mellon Institute of Industrial Research to form Carnegie Mellon University. The university\'s 140-acre main campus is 3 miles from Downtown Pittsburgh and abuts the Carnegie Museums of Pittsburgh, the main branch of the Carnegie Library of Pittsburgh, Schenley Park, Phipps Conservatory and Botanical Gardens, and the campus of the University of Pittsburgh in the city\'s Oakland and Squirrel Hill neighborhoods, partially extending into Shadyside.\nCarnegie Mellon has seven colleges and independent schools: the Carnegie Institute of Technology, College of Fine Arts, Dietrich College of Humanities and Social Sciences, Mellon College of Science, Tepper School of Business, H. John Heinz III College and the School of Computer Science.'),('/m/0d4y32','The People\'s Petition was an online campaign to express support for medical experimentation using animals in the United Kingdom. Within a year of launch the number of signatures exceeded 21,850 and included Tony Blair, the then-serving Prime Minister.'),('/m/0d5n7m','The International Exposition of 1867, called \"exposition universelle [d\'art et d\'industrie] de 1867\" in French, was the second world\'s fair to be held in Paris, from 1 April to 3 November 1867. Forty two nations were represented at the fair. Following a decree of Emperor Napoleon III, the exposition was prepared as early as 1864, in the midst of the renovation of Paris, marking the culmination of the Second French Empire.'),('/m/0d5sjb','The Light of the World is an allegorical painting by William Holman Hunt representing the figure of Jesus preparing to knock on an overgrown and long-unopened door, illustrating Revelation 3:20: \"Behold, I stand at the door and knock; if any man hear My voice, and open the door, I will come in to him, and will sup with him, and he with Me\". According to Hunt: \"I painted the picture with what I thought, unworthy though I was, to be by Divine command, and not simply as a good Subject.\" The door in the painting has no handle, and can therefore be opened only from the inside, representing \"the obstinately shut mind\". Hunt, 50 years after painting it, felt he had to explain the symbolism.\nThe original, painted at night in a makeshift hut at Worcester Park Farm in Surrey, is now in a side room off the large chapel at Keble College, Oxford. Toward the end of his life, Hunt painted a life-size version, which was hung in St Paul\'s Cathedral, London, after a world tour where the picture drew large crowds. Due to Hunt\'s increasing infirmity, he was assisted in the completion of this version by English painter Edward Robert Hughes.'),('/m/0d8gg5','The Human Genome Project is an international scientific research project with the goal of determining the sequence of chemical base pairs which make up human DNA, and of identifying and mapping all of the genes of the human genome from both a physical and functional standpoint. It remains the world\'s largest collaborative biological project. The project was proposed and funded by the US government ; planning started in 1984, the project got underway in 1990, and was declared complete in 2003. A parallel project was conducted outside of government by the Celera Corporation, or Celera Genomics, which was formally launched in 1998. Most of the government-sponsored sequencing was performed in universities and research centres in China, France, Germany, Japan, Spain, the United Kingdom, and the United States.\nThe Human Genome Project originally aimed to map the nucleotides contained in a human haploid reference genome. The \"genome\" of any given individual is unique; mapping \"the human genome\" involves sequencing multiple variations of each gene. The project did not study the entire DNA found in human cells; some heterochromatic areas remain unsequenced.'),('/m/0dbwsn','My Bed is a work by the British artist Tracey Emin. First created in 1998, it was exhibited at the Tate Gallery in 1999 as one of the shortlisted works for the Turner Prize. It consisted of her bed with bedroom objects in an abject state, and gained much media attention. Although it did not win the prize, its notoriety has persisted.\nThe artwork generated considerable media furore, particularly over the fact that the bedsheets were stained with bodily secretions and the floor had items from the artist\'s room. The bed was presented in the state that Emin claimed it had been when she said she had not got up from it for several days due to suicidal depression brought on by relationship difficulties.\nTwo performance artists, Yuan Chai and Jian Jun Xi, jumped on the bed with bare torsos in order to improve the work, which they thought had not gone far enough. They called their performance Two Naked Men Jump into Tracey\'s Bed. The men also had a pillow fight on the bed for around fifteen minutes, to applause from the crowd, before being removed by security guards. The artists were detained but no further action was taken.'),('/m/0f4rkr','Paul Durand-Ruel was a French art dealer who is associated with the Impressionists. He was one of the first modern art dealers who provided support to his painters with stipends and solo exhibitions.'),('/m/0f96_c','The Well at the World\'s End is a fantasy novel by the British artist, poet, and author William Morris. It was first published in 1896 and has been reprinted a number of times since, most notably in two parts as the twentieth and twenty-first volumes of the Ballantine Adult Fantasy series in August and September 1970. It is also available in one volume along with a similar Morris tale, The Wood Beyond the World, in On the Lines of Morris\' Romances: Two Books that Inspired J. R. R. Tolkien.'),('/m/0fqb3xb','The 2006 Raindance Film Festival was held from September 27, 2006 to October 8, 2006.'),('/m/0fwcr8','a, A Novel is a 1968 book by the American artist Andy Warhol published by Grove Press. It is a nearly word-for-word transcription of tapes recorded by Warhol and Ondine over a two-year period in 1965-1967.'),('/m/0g3r6','The Paris Commune was a revolutionary and socialist government that briefly ruled Paris from 18 March until 28 May 1871. The killing of two French army generals by soldiers of the Commune\'s National Guard and the refusal of the Commune to accept the authority of the French government led to its harsh suppression by the regular French Army in \"La Semaine sanglante\" beginning on 21 May 1871. Debates over the policies and outcome of the Commune had significant influence on the ideas of Karl Marx.'),('/m/0gcgd','Roy Fox Lichtenstein was an American pop artist. During the 1960s, along with Andy Warhol, Jasper Johns, and James Rosenquist among others, he became a leading figure in the new art movement. His work defined the basic premise of pop art through parody. Favoring the comic strip as his main inspiration, Lichtenstein produced hard-edged, precise compositions that documented while it parodied often in a tongue-in-cheek humorous manner. His work was heavily influenced by both popular advertising and the comic book style. He described pop art as \"not \'American\' painting but actually industrial painting\". His paintings were exhibited at the Leo Castelli Gallery in New York City.\nWhaam! and Drowning Girl are generally regarded as Lichtenstein\'s most famous works, with Oh, Jeff...I Love You, Too...But... arguably third. Drowning Girl, Whaam! and Look Mickey are regarded as his most influential works. Woman with Flowered Hat has held the record for highest Lichtenstein auction price since May 15, 2013.'),('/m/0gg4_sx','House I is a sculpture by Roy Lichtenstein.\nIt is located at the National Gallery of Art Sculpture Garden.\nThe house uses optical illusion to play with perspective. To appreciate the full effect, walk at a steady rate along the arc of the sidewalk that runs in front of and nearly perpendicular to the sculpture, with your head turned to one side, facing the sculpture. The house will appear to be spinning in space, like the \"Wizard of Oz\" house.\nIt was constructed of painted aluminum, modeled in 1996 and constructed in 1999.\nAmong his last works, it was a part of the House series. House II was shown at the Venice Biennale in 1997, and House III was shown at the Metropolitan Museum of Art.'),('/m/0gjd7w2','The Prophet Isaiah is a fresco located in Basilica di Sant\'Agostino, an early Renaissance church in Rome. It is an Italian Renaissance painting, influenced by Michaelangelo\'s work on the Sistine Chapel ceiling.\nIsaiah, a powerful figure, gives the illusion of a three-dimensional character, flanked by putti figures. He carries a Hebrew scroll with his prophecy foretelling the birth of Christ. There is also a message to Saint Anne. Due to wear, Raphael\'s work has been retouched by other painters over time. In 1960, the fresco was restored to Raphael\'s vision.'),('/m/0gmdgc3','The Temptations of Christ is a fresco by the Italian Renaissance painter Sandro Botticelli, executed in 1480–1482 and located in the Sistine Chapel, Rome.'),('/m/0gmg3yb','The Punishment of the Rebels is a fresco by the Italian Renaissance painter Sandro Botticelli, executed in 1480-1482 and located in the Sistine Chapel, Rome.'),('/m/0gv4w9','The Madonna and Child with Two Angels is a painting by the Italian Renaissance master Sandro Botticelli, dating to c. 1468-1469. It is housed in the Museo Nazionale di Capodimonte, in Naples.\nThis works was once attributed to Filippino Lippi, master of Botticelli. The typology of the faces and other details induce to date the work to the same period of the Fortitude and the other juvenile Madonnas of the Italian painter. The composition is similar to Verrocchio\'s Madonna of the Milk, dating from the late 1460s.'),('/m/0gv5kv','The Portrait of a Young Man is a painting by the Italian Renaissance artist Sandro Botticelli, dated between 1470 and 1475. It is housed in the Palazzo Pitti of Florence.\nVariously attributed to different painters, it was eventually included in Botticelli\'s works. It is one of the first known three-quarters portraits in western European art.'),('/m/0gw9b5j','Rouen Cathedral, Full Sunlight (1894) is a painting by French Impressionist artist Claude Monet.'),('/m/0gw_f29','The Holy Virgin Mary is a painting created by Chris Ofili in 1996. It was one of the works included in the Sensation exhibition in London, Berlin and New York in 1997–2000. The subject of the work, and its execution, caused considerable controversy in New York, with Rudolph Giuliani – then Mayor of New York City – describing Ofili\'s work as \"sick\".\nOn a yellow-orange background, the large painting depicts a black woman wearing a blue robe, a traditional attribute of the Virgin Mary. The work employs mixed media, including oil paint, glitter, and polyester resin, and also elephant dung and collaged pornographic images. The central Black Madonna is surrounded by many collaged images that resemble butterflies at first sight, but on closer inspection are photographs of female genitalia; an ironic reference to the putti that appear in traditional religious art. A lump of dried, varnished elephant dung forms one bared breast, and the painting is displayed leaning against the gallery wall, supported by two other lumps of elephant dung, decorated with coloured pins: the pins on the left are arranged to spell out \"Virgin\" and the one on the right \"Mary\". Many other works by Ofili in this period – including No Woman No Cry – incorporate elephant dung, particularly as supports for the canvas, inspired by a period that Ofili spent in Zimbabwe.'),('/m/0gx21w5','The Magpie is an oil-on-canvas landscape painting by the French Impressionist Claude Monet, created during the winter of 1868–1869 near the commune of Étretat in Normandy. Monet\'s patron, Louis Joachim Gaudibert, helped arrange a house in Étretat for Monet\'s girlfriend Camille Doncieux and their newborn son, allowing Monet to paint in relative comfort, surrounded by his family.\nBetween 1867 and 1893, Monet and fellow Impressionists Alfred Sisley and Camille Pissarro painted hundreds of landscapes illustrating the natural effect of snow. Similar winter paintings of lesser quantity were produced by Pierre-Auguste Renoir, Gustave Caillebotte, and Paul Gauguin. Art historians believe that a series of severe winters in France contributed to an increase in the number of winter landscapes produced by Impressionists.\nThe Magpie is one of approximately 140 snowscapes produced by Monet. His first snowscape, A Cart on the Snowy Road at Honfleur, was painted sometime in either 1865 or 1867, followed by a notable series of snowscapes in the same year, beginning with the Road by Saint-Simeon Farm in Winter. The Magpie was completed in 1869 and is Monet\'s largest winter painting.'),('/m/0h0vk','Contemporary art is art produced at the present period in time. Contemporary art includes, and develops from, Postmodern art, which is itself a successor to Modern art. In vernacular English, \"modern\" and \"contemporary\" are synonyms, resulting in some conflation of the terms \"modern art\" and \"contemporary art\" by non-specialists.'),('/m/0h65pvz','The Portrait of Emilia Pia da Montefeltro is a picture from around 1504-1505, attributed to the Italian Renaissance artist Raphael and housed by the Baltimore Museum of Art, United States'),('/m/0h68znm','The Portrait of Guidobaldo da Montefeltro is a picture by the Italian Renaissance artist Raphael, dating from around 1506 and housed in the Uffizi Gallery, Florence. It portrays Guidobaldo da Montefeltro, duke of Urbino.'),('/m/0hc9drb','\"The Manneporte near Étretat\" is a painting of Claude Monet. Monet visited Étretat, a fishing village and resort along the Normandy coast, in 1883, 1885, and 1886. His paintings from these trips focus on the dramatic rock formations—in particular, the Manneporte, which is the subject of six canvases that mark the beginning of his practice of painting in series. \nIn 1886, the writer Guy de Maupassant published his eyewitness account of Monet at Étretat. \"The artist walked along the beach, followed by children carrying five or six canvases representing the same subject at different times of the day and with different effects. He took them up and put them aside by turns according to changes in the sky and shadows.\" Monet refined the pictures in his studio'),('/m/0hc9fxq','\"Haystacks (Effect of Snow and Sun)\" is a painting of the artist Claude Monet. Between summer 1890 and winter 1891 Monet executed about thirty paintings of the haystacks in a field near his house at Giverny. In the midst of this effort, he wrote to the critic Gustave Geoffroy: \"I am working very hard, struggling with a series of different effects (haystacks), but at this season the sun sets so fast I cannot follow it. . . . The more I continue, the more I see that a great deal of work is necessary in order to succeed in rendering what I seek.\" Although Monet had painted multiple versions of a single subject earlier, \"Haystacks\" was the first group that he exhibited as a series; in 1891, fifteen were shown at the Galerie Durand-Ruel in Paris.'),('/m/0hc9gzc','Monet painted \"The Valley of the Nervia\" during a ten-week trip to the Italian Riviera in early 1884. The river Nervia flows into the Mediterranean near the French-Italian border between Ventimiglia and Bordighera. The Maritime Alps are visible in the background behind the village of Camporosso. In this painting Monet employs the lighter, brighter palette that he first adopted after a trip to the Riviera in 1883.'),('/m/0hc9py6','Monet\'s painting of his wife, Camille Doncieux.\n\"Camille Monet on a Garden Bench\" is the most enigmatic of Monet\'s rare genre pictures. Numerous interpretations have been offered, yet nothing has been found in the literature or theater of Monet\'s time that corresponds to this scene. The most telling clue may be biographical: the death of Camille\'s father in September 1873. Camille was an impassive model, but here she telegraphs sadness, while holding a note in her gloved hand. Later, Monet identified the gentleman as a neighbor—perhaps one who had called to offer his condolences and a consoling bouquet.'),('/m/0hc9s95','This work is one of four similar views of the plain of Gennevilliers, just southeast of Argenteuil, which Monet executed in summer 1875. He first painted the subject two years earlier in the celebrated \"Poppies near Argenteuil\" (Musée d\'Orsay, Paris).'),('/m/0hc9x6h','The Bodmer Oak—named after the Swiss artist Karl Bodmer (1809-1893), who exhibited his painting of the tree at the 1850 Salon—was one of several imposing trees in the Fontainebleau Forest that had acquired a special appellation.\nThe carpet of russet leaves signals that Monet painted this canvas just before he left Chailly-en-Bière, near Fontainebleau, in October 1865. It is probably the last of several landscapes executed in connection with his monumental \"Déjeuner sur l\'herbe\" (fragments of which are now at the Musée d\'Orsay, Paris). \nThe slash in the upper right-hand corner of the painting may have been made by Monet, who reputedly mutilated some canvases in order to discourage a landlord from seizing them in 1866.'),('/m/0hnb6fd','The Apache Campaign of 1896 was the final United States Army operation against Apache renegades. It began in April after some Apaches killed three American settlers in Arizona. The renegades were pursued by the army, which caught up with the hostiles in the Four Corners region of Arizona, New Mexico, Sonora and Chihuahua. There were only two important encounters during the campaign and, because both of them occurred in the remote Four Corners region, it is unknown if they took place on American or Mexican soil.'),('/m/0hnc11l','The Madonna of the Candelabra is a Madonna painting by the Italian renaissance artist Raphael, dating to about 1513 and is in the collection of the Walters Art Museum in Baltimore.\nPainted during his Roman period, this tondo Madonna of the Virgin and Child employs a rare motif of flanking candelabra that was derived from representations of ancient Roman emperors. Through this reference to the rulers of antiquity, Raphael alludes to Christ\'s and Mary\'s roles as the king and queen of Heaven. Raphael was famed for his graceful style. which combined the study of classical sculpture and nature. The chiaroscuro effects and gentle coloring give the figures a soft, delicate appearance. The painting relies heavily on the participation of Raphael\'s workshop, and the two angels certainly were done by his assistants. This was the first Madonna painted by Raphael to enter a North American collection. It was purchased by Henry Walters in 1901.\nThe central portion of the painting was issued as the traditional holiday first class Christmas stamp for 2011 by the United States Postal Service. The stamp was released on October 13, 2011 in New York, New York.'),('/m/0hr16yq','Alexa Wilding was one of the favourite models of the Pre-Raphaelite artist Dante Gabriel Rossetti, featuring in some of his finest paintings of the later 1860s and early 1870s. She sat for more of his finished works than any other of his more well known muses, Elizabeth Siddall, Jane Morris and Fanny Cornforth.\nComparatively little is known about Rossetti\'s most used model, while Siddall, Morris and Cornforth are frequently written about. This is perhaps partly due to the lack of romantic or sexual connection that separates Rossetti\'s relationship with Wilding from his other muses.'),('/m/0j7ng','Newcastle upon Tyne, commonly known as Newcastle, and historically known as Newcastle-on-Tyne, is a city and metropolitan borough in Tyne and Wear, North East England, situated on the north bank of the River Tyne and centred 8.5 mi from the North Sea. It is the most populous city in North East England. The city lies at the urban core of the Tyneside conurbation, which is the seventh most populous conurbation in the United Kingdom and the most populous in the North East region. Newcastle is a member of the English Core Cities Group and with Gateshead the Eurocities network of European cities. Newcastle was part of the county of Northumberland until 1400 when it became a county of itself; a status it retained until becoming part of the Tyne and Wear metropolitan county in 1974.\nThe city grew up in the area that was the location of the Roman settlement called Pons Aelius, and it owes its name to the castle built in 1080, by Robert, Duke of Normandy, \"Curthose\", William the Conqueror\'s eldest son. The city grew as an important centre for the wool trade and it later became a major coal mining area.'),('/m/0jr3g','Alessandro di Mariano di Vanni Filipepi, better known as Sandro Botticelli, was an Italian painter of the Early Renaissance. He belonged to the Florentine School under the patronage of Lorenzo de\' Medici, a movement that Giorgio Vasari would characterize less than a hundred years later as a \"golden age\", a thought, suitably enough, he expressed at the head of his Vita of Botticelli. Botticelli\'s posthumous reputation suffered until the late 19th century; since then his work has been seen to represent the linear grace of Early Renaissance painting. Among his best known works are The Birth of Venus and Primavera.'),('/m/0k0t_cx','Gather Ye Rosebuds While Ye May is an oil painting on canvas created in 1909 by British Pre-Raphaelite artist, John William Waterhouse. It was the second of two paintings inspired by the 17th century poem \"To the Virgins, to Make Much of Time\" by Robert Herrick which begins:\nGather ye rosebuds while ye may,\nOld Time is still a-flying;\nAnd this same flower that smiles today,\nTomorrow will be dying.\nThe artwork was valued at $2.5 million by Sotheby\'s prior to auction in April 2007, although the painting went unsold.'),('/m/0k3p','Amsterdam is the capital city of and the most populous within the Kingdom of the Netherlands. Its status as the Dutch capital is mandated by the Constitution of the Netherlands though it is not the seat of the Dutch government, which is at The Hague. Amsterdam has a population of 810,909 within the city-proper, 1,108,297 in the urban region and 1,571,234 in the greater metropolitan area. The city is located in the province of North Holland in the west of the country. It comprises much of the northern part of the Randstad, one of the larger conurbations in Europe, with a population of approximately 7 million.\nAmsterdam\'s name derives from Amstelredamme, indicative of the city\'s origin as a dam of the river Amstel. Originating as a small fishing village in the late 12th century, Amsterdam became one of the most important ports in the world during the Dutch Golden Age, a result of its innovative developments in trade. During that time, the city was the leading center for finance and diamonds. In the 19th and 20th centuries, the city expanded, and many new neighborhoods and suburbs were planned and built.'),('/m/0k5mt','John Ruskin was the leading English art critic of the Victorian era, also an art patron, draughtsman, watercolourist, a prominent social thinker and philanthropist. He wrote on subjects ranging from geology to architecture, myth to ornithology, literature to education, and botany to political economy. His writing styles and literary forms were equally varied. Ruskin penned essays and treatises, poetry and lectures, travel guides and manuals, letters and even a fairy tale. The elaborate style that characterised his earliest writing on art was later superseded by a preference for plainer language designed to communicate his ideas more effectively. In all of his writing, he emphasised the connections between nature, art and society. He also made detailed sketches and paintings of rocks, plants, birds, landscapes, and architectural structures and ornamentation.\nHe was hugely influential in the latter half of the 19th century, and up to the First World War. After a period of relative decline, his reputation has steadily improved since the 1960s with the publication of numerous academic studies of his work.'),('/m/0k9v2vm','Silvia Crastan is an actress and a musician.'),('/m/0kc6','Andy Warhol was an American artist who was a leading figure in the visual art movement known as pop art. His works explore the relationship between artistic expression, celebrity culture and advertisement that flourished by the 1960s. After a successful career as a commercial illustrator, Warhol became a renowned and sometimes controversial artist. The Andy Warhol Museum in his native city, Pittsburgh, Pennsylvania, holds an extensive permanent collection of art and archives. It is the largest museum in the United States dedicated to a single artist.\nWarhol\'s art encompassed many forms of media, including hand drawing, painting, printmaking, photography, silk screening, sculpture, film, and music. He was also a pioneer in computer-generated art using Amiga computers that were introduced in 1984, two years before his death. He founded Interview Magazine and was the author of numerous books, including The Philosophy of Andy Warhol and Popism: The Warhol Sixties. He is also notable as a gay man who lived openly as such before the gay liberation movement.'),('/m/0lqfqvm','The Story of Nastagio Degli Onesti, part one is a painting in tempera on wood by Sandro Botticelli, dated 1483. It measures 83 x 138 cm and is held in the Prado in Madrid.'),('/m/0m_z3','County Galway is a county in Ireland. It is located in the West Region and is also part of the province of Connacht. It is named after the city of Galway. Galway County Council is the local authority for the county. There are several strongly Irish-speaking areas in the west of the county. The population of the county is 250,541 according to the 2011 census.'),('/m/0pxg1wz','The 1983 British Academy Film and Television Awards took place in 1983 in London, England.'),('/m/0pxg2ns','The 1988 British Academy Film and Television Awards took place on 1988 in London, England.'),('/m/0pxg4t5','The 2005 British Academy Film Awards took place on February 12, 2005 in London, England.'),('/m/0q0f4','Sir John Everett Millais, 1st Baronet, PRA was an English painter and illustrator who was one of the founders of the Pre-Raphaelite Brotherhood.\nA child prodigy, at the age of 11 he became the youngest student to enter the Royal Academy Schools. The Pre-Raphaelite Brotherhood was founded at his parents\' house in London. Millais became the most famous exponent of the style, his painting Christ in the House of his Parents generating considerable controversy. By the late 1850s Millais was moving away from the Pre-Raphaelite style. His later works were enormously successful, making Millais one of the wealthiest artists of his day. However, they have typically been viewed by 20th century critics as failures. This view has changed in recent decades, as his later works have come to be seen in the context of wider changes in the art world.\nMillais\' personal life has also played a significant role in his reputation. His wife Effie was formerly married to the critic John Ruskin, who had supported Millais\' early work. The annulment of the marriage and her marriage of Millais have sometimes been linked to his change of style.'),('/m/0q245','The Pre-Raphaelite Brotherhood was a group of English painters, poets, and critics, founded in 1848 by William Holman Hunt, John Everett Millais and Dante Gabriel Rossetti. The three founders were joined by William Michael Rossetti, James Collinson, Frederic George Stephens and Thomas Woolner to form the seven-member \"brotherhood\".\nThe group\'s intention was to reform art by rejecting what it considered the mechanistic approach first adopted by Mannerist artists who succeeded Raphael and Michelangelo. Its members believed the Classical poses and elegant compositions of Raphael in particular had been a corrupting influence on the academic teaching of art, hence the name \"Pre-Raphaelite\". In particular, the group objected to the influence of Sir Joshua Reynolds, founder of the English Royal Academy of Arts, whom they called \"Sir Sloshua\". To the Pre-Raphaelites, according to William Michael Rossetti, \"sloshy\" meant \"anything lax or scamped in the process of painting ... and hence ... any thing or person of a commonplace or conventional kind\". In contrast, the brotherhood wanted a return to the abundant detail, intense colours and complex compositions of Quattrocento Italian art.'),('/m/0q4mn','Pop art is an art movement that emerged in the mid-1950s in Britain and in the late 1950s in the United States. Pop art presented a challenge to traditions of fine art by including imagery from popular culture such as advertising, news, etc. In pop art, material is sometimes visually removed from its known context, isolated, and/or combined with unrelated material. The concept of pop art refers not as much to the art itself as to the attitudes that led to it.\nPop art employs aspects of mass culture, such as advertising, comic books and mundane cultural objects. It is widely interpreted as a reaction to the then-dominant ideas of abstract expressionism, as well as an expansion upon them. And due to its utilization of found objects and images it is similar to Dada. Pop art is aimed to employ images of popular as opposed to elitist culture in art, emphasizing the banal or kitschy elements of any given culture, most often through the use of irony. It is also associated with the artists\' use of mechanical means of reproduction or rendering techniques.'),('/m/0r5225s','The 2005 Sci-Fi-London Film Festival was held from February 2, 2005 to February 6, 2005.'),('/m/0tm50_z','The 2004 Raindance Film Festival was held in London, England, UK from 1 October to 10 October 2004.'),('/m/0t_g0l5','Brushstrokes is a 1996 sculpture by Roy Lichtenstein, installed at the Portland Art Museum in Portland, Oregon. It is part of the Brushstrokes series of artworks that includes several paintings and sculptures whose subject is the actions made with a house-painter\'s brush.'),('/m/0vh96','William Holman Hunt OM was an English painter, and one of the founders of the Pre-Raphaelite Brotherhood.'),('/m/0vzrw9x','Hopeless is a 1963 painting with oil paint and acrylic paint on canvas by Roy Lichtenstein. The painting is in the collection of the Kunstmuseum Basel.'),('/m/0w1fb4h','Masterpiece is a 1962 pop art painting by Roy Lichtenstein that uses his classic Ben-Day dots and a speech balloon. It is known for its narrative content that predicted Lichtenstein\'s fame.'),('/m/0w2zrjm','Jet Pilot is a 1962 pop art work done in graphite pencil by Roy Lichtenstein. Like many of Lichtenstein\'s works from this time period, it is was inspired by a comic book image, but he made notable modifications of the source in his work.'),('/m/0w2zy6p','The Melody Haunts My Reverie is a 1965 screen printing by Roy Lichtenstein, referring to the 1927 song \"Stardust\" by Hoagy Carmichael. The painting is housed in Housatonic Museum of Art and another copy signed by Lichtenstein is kept in Neuberger Museum of Art.\nThe woman on the image, holding a microphone, was likened to modern character of Betty Draper from Mad Men. The painting was described as being among those that \"don\'t lower art to the level of the comic strip but raise the comic strip to the level of high art\". A version of The Melody Haunts My Reverie from 11 Pop Artists, Volume II was sold at Christie\'s for $17,250.'),('/m/0w3449s','Electric Cord is a 1961 pop art painting by Roy Lichtenstein. In October 2012, the painting was returned to the widow of Leo Castelli after it had gone missing 42 years prior. Castelli had purchased the painting in the 1960s for $750. In 2012 it was estimated to be worth $4 million.'),('/m/0w3469y','Varoom! is a 1963 pop art painting by Roy Lichtenstein that depicts an explosion and the onomatopoeic sound that gives it its name.'),('/m/0w7q9gg','Ten Dollar Bill is a 1956 proto-pop art lithographic drawing by Roy Lichtenstein. Considered to be a combination of Americana art and cubism, the work is referred to as the beginning to Lichtenstein\'s work on pop art. Twenty-five editions of the lithograph were made by Lichtenstein, which were exhibited at several galleries. The piece is based on the design for the ten-dollar bill and has influenced several of Lichtenstein\'s later works. The picture has received generally favorable reception from critics, and is considered to be one of the best artistic portrayals of currency.'),('/m/0xnq1l3','Verity is a stainless steel and bronze statue created by Damien Hirst. The 67-foot tall sculpture stands on the pier in Ilfracombe, Devon and looks out over the harbour. It has been loaned to the town for 20 years. The name of the piece refers to \"truth\" and Hirst describes his work as a \"modern allegory of truth and justice\".\nThe statue depicts a pregnant woman holding aloft a sword while carrying the scales of justice and standing on a pile of law books. Half of the sculpture shows the internal anatomy of the pregnant woman, with the unborn baby clearly visible. The stance has been described as a reference to Little Dancer of Fourteen Years by Edgar Degas, a work that previously inspired Hirst when he created Virgin Mother.\nThe sculpture was cast in stainless steel and bronze in 40 separate sections by Pangolin Editions. The sword, which gives the statue much of its height, and the upper left arm is one polymer-strengthened fibre glass piece. Before being cleared for erection the statue was subjected to tests in a wind tunnel to ensure that it could cope with high winds and spray from the sea.'),('/m/0y7y877','Willie Doherty: False Memory is a 2003 Turner Prize Award nominated work by Willie Doherty.'),('/m/0y7_lkf','The 1995 Turner Prize Award ceremony was held on 28 November 1995.'),('/m/0y817nw','The Only Good One is a Dead One is a 1994 Turner Prize Award nominated work by Willie Doherty.'),('/m/0yczmbt','The 1986 Turner Prize Award ceremony was held on 25 November 1986.'),('/m/0yhj_pv','Annlee You Proposes is a 2002 Turner Prize Award nominated work by Liam Gillick.'),('/m/0yj7tmx','Drunk With God is a mixed media artwork by Gilbert and George.'),('/m/0ym3hvh','2006 UK Festival Awards Ceremony hosted by Steve Harris, was held on October 18, 2006 in O2 Academy Islington.'),('/m/0yp09kp','Re-Run is a 2003 Turner Prize Award nominated work by Willie Doherty.'),('/m/0ytfyp3','Gilbert & George. The Complete Pictures 1971 - 1985 is a 1986 Turner Prize Award winning work by Gilbert & George.'),('/m/0_kty8x','The 2005 Raindance Film Festival was held from September 28, 2005 to October 9, 2005.'),('/m/0_qg48g','Mickey is a household gloss on canvas painting by Damien Hirst executed in 2012. Hirst was invited by Disney to create an artwork inspired by Mickey Mouse and this was his response. The work was auctioned at Christie\'s, London, on 13 February 2014 in aid of Kids Company, a charity Hirst has long supported, fetching £902,500.\nThe auction lot notes quote Hirst as commenting:\nThe thing about Mickey is that even though he’s gone through so many shifts in form and association, he’s timeless. In a way he means the same in the 21st century as he did decades ago. I watched the cartoons as a kid, and my kids watch them too. He’s relevant because he’s remained so culturally ingrained and he still just looks so great. The way children are entertained today has obviously changed dramatically, but kids are still kids, and love the same things.\n\nIt’s using simple means to capture the very essence of his form solely through the power of colour. I love that the imagery is so powerful that it only takes twelve different coloured dots to create something so instantly recognisable.'),('/m/0_w3mn5','The painting was formerly attributed to Raffaello Sanzio.');
